INSERT INTO "timeline_keeper_events" VALUES(13,'Aegina','The Spartans, led by King Archidamus II, invade Attica effectively starting the Second Peloponnesian War between the Athenian Empire and the Peloponnesian League. The Spartans lay waste to the countryside around Athens. Athenian leader, Pericles, does not seriously oppose them, rather withdrawing the rural population of the country districts within Athens'' city walls. Instead, he pursues active naval warfare and reduces any danger from the island of Aegina by replacing its native population with Athenians.','37.749997','23.4333316','-431','0','0','-431-0-0 00:00:00.000000','-431-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(14,'Aegina','Pericles, concerned over the draining effect of years of war on Athenian manpower, looks for peace with the support of the Assembly. Athenian diplomat, Callias, goes to Sparta and after much bargaining arranges a peace treaty with Sparta and her Peloponnesian allies, thus extending the 5 years truce of 451 BC for another 30 years. According to this treaty, Megara is to be returned to the Peloponnesian League, Troezen and Achaea become independent, Aegina is to become a tributary to Athens but autonomous, and disputes are to be settled by arbitration. Each party agrees to respect the alliances of the other.','37.749997','23.4333316','-445','0','0','-445-0-0 00:00:00.000000','-445-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
