INSERT INTO "timeline_keeper_events" VALUES(518,'Boeotia','Athens arranges an alliance with Euboea, Megara, Achaea, Corinth, Acarnania and some other states in the Peloponnesus. However, the most desirable ally for Athens is Thebes. Therefore, the Athenian leader, Demosthenes, goes to the Boeotian city and secures an alliance with Thebes despite the efforts of a Macedonian deputation to persuade Thebes to join with Macedonia. In return, Athens agrees to Thebes'' controlling Boeotia, Thebes being in command solely on land and jointly at sea, and Athens paying two thirds of the campaign''s cost.','38.8999964','22.5333312','-338','0','0','-338-0-0 00:00:00.000000','-338-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
