INSERT INTO "timeline_keeper_events" VALUES(520,'Boeotia','Nicias, the leader of the aristocratic and peace party in Athens and Pleistoanax, King of Sparta, negotiate the Peace of Nicias between Athens and Sparta, which brings a temporary end to the Peloponnesian War. The essence of the Peace of Nicias is a return to the prewar situation: most wartime gains are to be returned. Seventeen representatives from each side swear an oath to uphold the treaty, which is meant to last for thirty years or one generation (meaning they are not responsible for the next generation''s decision). All of Sparta''s allies agree to sign the peace, except for the Boeotians, Corinth, Elis, and Megara.','38.8999964','22.5333312','-421','0','0','-421-0-0 00:00:00.000000','-421-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
