INSERT INTO "timeline_keeper_events" VALUES(527,'Boeotia','Learning that the Spartan garrison of Orchomenus (in Boeotia) is leaving for an expedition to Locris, Pelopidas sets out with the Sacred Band of Thebes and a small force of cavalry, intending to seize the city while it is unguarded. However, as the Thebans approach the city, they learn that a sizable force has been dispatched from Sparta to reinforce the garrison at Orchomenus and is approaching the city. Pelopidas retreats with his force, but before the Thebans can reach safety at Tegyra, they meet the original Spartan garrison returning from Locris. In the ensuing Battle of Tegyra, the Thebans rout the larger Spartan force.','38.8999964','22.5333312','-375','0','0','-375-0-0 00:00:00.000000','-375-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
