INSERT INTO "timeline_keeper_events" VALUES(745,'Cappadocia','Emperor Hadrian continues his voyages, now inspecting Caria, Cappadocia and Syria.','38.668997324','34.836829986','129','0','0','129-0-0 00:00:00.000000','129-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(746,'Cappadocia','Gnaeus Domitius Corbulo, Roman commander in the east, captures Tigranocerta in Mesopotamia. He installed Tigranes VI, a Cappadocian prince, as ruler of Armenia. For the next four years, a cohort from Legio VI Ferrata and Legio X Fretensis is stationed in the capital as bodyguard to the king, supported by fifteen hundred auxiliaries.','38.668997324','34.836829986','59','0','0','59-0-0 00:00:00.000000','59-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(747,'Cappadocia','Winter?Domitius Corbulo marched his legions (Legio VI Ferrata and Legio X) into the mountains of Cappadocia and made camp. He gives the men a harsh training, twenty-five-mile marches and weapons drills.','38.668997324','34.836829986','54','0','0','54-0-0 00:00:00.000000','54-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(748,'Cappadocia','Antony reorganized Asia Minor under strongmen loyal to him. He raised troops from his allies Amyntas and Archelaus, kings of Galatia and Cappadocia. The old kingdom of Pontus is restored, from Armenia to the River Halys under Polemon I.','38.668997324','34.836829986','-37','0','0','-37-0-0 00:00:00.000000','-37-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(749,'Cappadocia','Alexander the Great''s various generals control different parts of Alexander''s empire. Ptolemy controls Egypt, Seleucus controls Babylon and Syria, Antipater and his son Cassander control Macedon and Greece, Antigonus controls Phrygia and other parts of Asia Minor, Lysimachus controls Thrace and Pergamum and Eumenes controls the Cappadocia and Pontus areas.','38.668997324','34.836829986','-320','0','0','-320-0-0 00:00:00.000000','-320-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(750,'Cappadocia','Antipater appoints Antigonus commander in chief of his army in Asia Minor and sends him with Craterus to fight against Eumenes, the satrap of Cappadocia and a supporter of Perdiccas.','38.668997324','34.836829986','-321','0','0','-321-0-0 00:00:00.000000','-321-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(751,'Cappadocia','Nicomedes IV of Bithynia bequeaths his kingdom to Rome on his death (75/4 BC), angry by the arrangement, Mithridates VI of Pontus declares war on Rome and invaded Bithynia, Cappadocia and Paphlagonia, thus starting the Third Mithridatic War.','38.668997324','34.836829986','-75','0','0','-75-0-0 00:00:00.000000','-75-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(752,'Cappadocia','After Ariarathes V has been deposed from the Cappadocian throne by the Seleucid king Demetrius I Soter and has fled to Rome, the new king of Cappadocia, Orophernes, sends two ambassadors to Rome to join the Seleucid emissaries of Demetrius in opposing Ariarathes V''s return to power. Despite their efforts, Ariarathes V is restored to his throne by the Romans. However, Rome allows Orophernes to reign jointly with him. The joint government, however, does not last long, as Ariarathes V becomes sole king of Cappadocia shortly afterwards.','38.668997324','34.836829986','-157','0','0','-157-0-0 00:00:00.000000','-157-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(753,'Cappadocia','Mithridates VI of Pontus invades Bithynia and Cappadocia, thus the First Mithridatic War begins.','38.668997324','34.836829986','-89','0','0','-89-0-0 00:00:00.000000','-89-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(754,'Cappadocia','Ariarathes VIII is forced out of Cappadocia by Mithridates, and dies soon afterwards.','38.668997324','34.836829986','-97','0','0','-97-0-0 00:00:00.000000','-97-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(755,'Cappadocia','At the request of the Romans, Ariarathes V, king of Cappadocia, rejects a proposal from the Seleucid king, Demetrius I, for him to marry the sister of Demetrius I. In response, Seleucid forces attack Cappadocia and remove Ariarathes V from the Cappadocian throne. Demetrius I then replaces him with Orophernes Nicephorus, a supposed son of the late king, Ariarathes IV. With Ariarathes V deprived of his kingdom, he flees to Rome.','38.668997324','34.836829986','-158','0','0','-158-0-0 00:00:00.000000','-158-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(756,'Cappadocia','King Darius II of Persia decides to continue the war against Athens and give support to the Spartans. His wife, Parysatis, persuades him to appoint his younger son, Cyrus, as satrap (governor) of Lydia, Phrygia, and Cappadocia and commander in chief of the Achaemenian forces in Asia Minor in place of Tissaphernes.','38.668997324','34.836829986','-408','0','0','-408-0-0 00:00:00.000000','-408-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(757,'Capri','Emperor Commodus escapes death at the hands of assassins, who have attacked him at the instigation of his sister Lucilla and a large group of senators. He puts many distinguished Romans to death on charges of being implicated in the conspiracy, Lucilla is exiled to Capri.','40.5499978','14.2333324','182','0','0','182-0-0 00:00:00.000000','182-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(758,'Capri','Emperor Tiberius retires to Capri, leaving the Praetorian Guard under Lucius Aelius Sejanus in charge of the Roman Empire and the city of Rome.','40.5499978','14.2333324','26','0','0','26-0-0 00:00:00.000000','26-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(759,'Caribbean','November &ndash; Crews on two ships commanded by Benjamin Hornigold and Edward Teach attack and capture the British-built French guineyman Concorde in the eastern Caribbean.  Hornigold soon accepts a British amnesty for all pirates, but Teach rejects it and subsequently becomes known as Blackbeard.','14.521997912','-75.817663396','1717','11','0','1717-11-0 00:00:00.000000','1717-11-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(760,'Caribbean','October 12 &ndash; Christopher Columbus'' expedition makes landfall in the Caribbean and lands on Guanahani, but believes he has reached the East Indies.','14.521997912','-75.817663396','1492','10','12','1492-10-12 00:00:00.000000','1492-10-12 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(761,'Caribbean','November 20 &ndash; The Cuban Missile Crisis ends: In response to the Soviet Union agreeing to remove its missiles from Cuba, U.S. President John F. Kennedy ends the quarantine of the Caribbean nation.','14.521997912','-75.817663396','1962','11','20','1962-11-20 00:00:00.000000','1962-11-20 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(762,'Caribbean','March 9 &ndash; the USS Enterprise reaches Wilmington, North Carolina, returning from the Caribbean.','14.521997912','-75.817663396','1814','3','9','1814-3-9 00:00:00.000000','1814-3-9 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(763,'Carmarthenshire','A storm buries the village of St Ismail near modern-day Kidwelly, Carmarthenshire, Wales.','51.853663252','-4.306332108','1606','0','0','1606-0-0 00:00:00.000000','1606-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(764,'Carnuntum','November 11?The Congress of Carnuntum: Attempting to keep peace within the Roman Empire, the leaders of the Tetrarchy declare Maxentius and Licinius to be Augusti, while rival contender Constantine I is declared Caesar of Britain and Gaul.','48.1166662','16.8666632','308','0','0','308-0-0 00:00:00.000000','308-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(765,'Carnuntum','Emperor Marcus Aurelius and his son Commodus arrive at Carnuntum in Pannonia, and travel to the Danube to fight against the Marcomanni.','48.1166662','16.8666632','178','0','0','178-0-0 00:00:00.000000','178-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(766,'Carnuntum','The Suebian tribes of the Marcomanni cross the Danube and invade northern Italy. The Roman army (20,000 men) is destroyed near Carnuntum.','48.1166662','16.8666632','170','0','0','170-0-0 00:00:00.000000','170-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(767,'Carthage','Lucius Postumius Albinus is sent by Rome as an ambassador to King Masinissa of Numidia, and to the Carthaginians in order to raise troops for the war against Perseus of Macedonia.','36.851829926','10.320498718','-171','0','0','-171-0-0 00:00:00.000000','-171-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(768,'Carthage','The peace treaty at the end of the Second Punic War requires that all border disputes involving Carthage be arbitrated by the Roman Senate and requires Carthage to get explicit Roman approval before going to war. As a result, envoys from Carthage appear before the Roman Senate to request resolution of a boundary dispute with Numidia. The dispute is decided in Numidia''s favour.','36.851829926','10.320498718','-172','0','0','-172-0-0 00:00:00.000000','-172-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(769,'Carthage','The Roman statesman Titus Quinctius Flamininus is sent to the court of Prusias I, king of Bithynia, to demand the surrender of the former Carthaginian statesman and general Hannibal. When Hannibal finds out that Prusias is about to agree to the Roman demands and thus betray him, he poisons himself in the village of Libyssa in Bithynia.','36.851829926','10.320498718','-183','0','0','-183-0-0 00:00:00.000000','-183-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(770,'Carthage','The Battle of the Eurymedon is fought between a Seleucid fleet and ships from Rhodes and Pergamum, who are allied with the Roman Republic. The Seleucids are led by the famous Carthaginian general Hannibal. The Rhodians and their allies are victorious and Hannibal''s fleet is forced to flee.','36.851829926','10.320498718','-190','0','0','-190-0-0 00:00:00.000000','-190-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(771,'Carthage','The Carthaginians manage to collect the indemnity due to Rome (through the peace treaty signed between them ten years earlier) but not payable in full for 50 years. The Romans, in order to keep their hold on Carthage, refuse to accept the early payment of the indemnity.','36.851829926','10.320498718','-191','0','0','-191-0-0 00:00:00.000000','-191-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(772,'Carthage','Carthage makes another effort to conquer all of Sicily. The Carthaginians dispatch some mercenaries to extend the conflict between Timoleon and the Sicilian tyrants. But this effort ends in the defeat of Hicetas, the tyrant of Leontini, who is taken prisoner and put to death. By a treaty between Syracuse and Carthage, the dominion of Carthage in Sicily is confined to the lands west of the Halycus (Platani) River.','36.851829926','10.320498718','-338','0','0','-338-0-0 00:00:00.000000','-338-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(773,'Carthage','With his peace agreement with the Egyptians in place, Antiochus III now turns his attention to the West. He is encouraged to challenge Rome''s protection of the Greeks by his advisor, the former Carthaginian general Hannibal.','36.851829926','10.320498718','-194','0','0','-194-0-0 00:00:00.000000','-194-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(774,'Carthage','Because of his administrative and constitutional reforms in Carthage, Hannibal becomes unpopular with an important faction of the Carthaginian nobility and he is denounced to the Romans for inciting the Seleucid king Antiochus III to take up arms against the Romans. Rome demands that Carthage surrender Hannibal. However, Hannibal voluntarily goes into exile.','36.851829926','10.320498718','-195','0','0','-195-0-0 00:00:00.000000','-195-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(775,'Carthage','Alcibiades urges the Athenians to conquer Syracuse, subdue Sicily and Carthage and thus gain added forces that will enable them to finish the war against Sparta. His bold offensive plan wins the support of the Athenians.','36.851829926','10.320498718','-418','0','0','-418-0-0 00:00:00.000000','-418-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(776,'Carthage','Hicetas, the tyrant of Leontini, again persuades Carthage to send a large army to Sicily, which lands at Lilybaeum. Timoleon of Syracuse meets this large Carthaginian army in the Battle of the Crimissus in the west of Sicily and achieves a brilliant victory against superior odds. Despite this victory, the Carthaginians continue to occupy the western half of Sicily, with a treaty being concluded that confines the Carthaginians to the area west of the Halycus (Platani) River.','36.851829926','10.320498718','-340','0','0','-340-0-0 00:00:00.000000','-340-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(777,'Carthage','The Insubres, Gauls of the Po Valley, believed by the Romans to have been incited to revolt by Carthage, are finally defeated.','36.851829926','10.320498718','-196','0','0','-196-0-0 00:00:00.000000','-196-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(778,'Carthage','The Corinthian general Timoleon spreads his rule over Sicily, removing a number of other tyrants and preparing Sicily for another threatened Carthaginian invasion.','36.851829926','10.320498718','-342','0','0','-342-0-0 00:00:00.000000','-342-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(779,'Carthage','Accused of treason by the Carthaginians after being defeated by the Romans at the Battle of the Great Plains, Hasdrubal Gisco commits suicide to avoid being lynched by a Carthaginian mob.','36.851829926','10.320498718','-202','0','0','-202-0-0 00:00:00.000000','-202-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(780,'Carthage','Having lost his alliance with the Numidian chief Masinissa, the Carthaginian general, Hasdrubal Gisco, finds a new ally in the Numidian king Syphax, who marries Sophonisba, Hasdrubal''s daughter, whom until his defection to Rome has been betrothed to Masinissa.','36.851829926','10.320498718','-204','0','0','-204-0-0 00:00:00.000000','-204-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(781,'Carthage','The aristocracy of Syracuse appeal to their mother city of Corinth against their tyrant Dionysius II. The Corinthian general Timoleon is chosen to lead a liberation force to Sicily. Landing at Tauromenium (Taormina) in the summer, Timoleon faces two armies, one under Dionysius and the other under Hicetas (tyrant of nearby Leontini), who has also called in Carthaginian forces. By shrewd tactics Timoleon defeats his enemies and occupies Syracuse.','36.851829926','10.320498718','-344','0','0','-344-0-0 00:00:00.000000','-344-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(782,'Carthage','In the Battle of Ilipa (Alcal� del R�o, near Seville) in Spain, the Carthaginian generals, Mago Barca and Hasdrubal Gisco, are defeated by the Roman general Publius Cornelius Scipio. Mago retreats to Gades (modern C�diz) and then sails for the Balearic Islands.','36.851829926','10.320498718','-206','0','0','-206-0-0 00:00:00.000000','-206-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(783,'Carthage','The Roman general Gaius Claudius Nero fights an indecisive battle with the Carthaginian general Hannibal at Grumentum. Nero is unable to stop Hannibal''s advance into Canusium. Nevertheless, he rapidly marches the elite parts of his army some one hundred kilometres north to reinforce the army of Marcus Livius Salinator.','36.851829926','10.320498718','-207','0','0','-207-0-0 00:00:00.000000','-207-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(784,'Carthage','The Romans under Fabius Maximus Cunctator capture Tarentum (modern Taranto), which the Carthaginian general Hannibal has held for three years.','36.851829926','10.320498718','-209','0','0','-209-0-0 00:00:00.000000','-209-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(785,'Carthage','Following the death of his father, Publius Cornelius Scipio, and his uncle, Gnaeus Cornelius Scipio Calvus, at the hands of the Carthaginians, the young Publius Cornelius Scipio takes over command of the Roman troops in Spain. His appointment reflects the Roman Senate''s dissatisfaction with the cautious strategy of the propraetor, Gaius Claudius Nero, then commander in Spain north of the Ebro.','36.851829926','10.320498718','-210','0','0','-210-0-0 00:00:00.000000','-210-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(786,'Carthage','The Carthaginian general Hasdrubal Barca returns to Spain after his victory over the rebellious Numidians. He then manages to turn the tide against the Romans in Spain, with the Roman generals Publius Cornelius Scipio and his brother Gnaeus Cornelius Scipio Calvus killed in separate battles?Publius on the upper Baetis (Guadalquivir) and Gnaeus in the hinterland of Carthago Nova (Cartagena). The Carthaginians recover all their territory south of the Ebro.','36.851829926','10.320498718','-211','0','0','-211-0-0 00:00:00.000000','-211-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(787,'Carthage','Syphax, king of the western Numidian tribe, the Masaesyli, concludes an alliance with the Romans and they send military advisers to help Syphax train his soldiers. He then attacks the eastern Numidians (the Massylii) ruled by Gala, who is an ally of the Carthaginians. The Carthaginian general Hasdrubal travels to northern Africa from Spain to stamp out the uprising by the Numidians.','36.851829926','10.320498718','-212','0','0','-212-0-0 00:00:00.000000','-212-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(788,'Carthage','September 13?Battle of Ad Decimum: Belisarius defeats the Vandals under Gelimer. Gelimer, forced to flee, leaves Carthage unprotected.','36.851829926','10.320498718','533','9','13','533-9-13 00:00:00.000000','533-9-13 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(789,'Carthage','Gaius Flaminius Nepos is re-elected consul with Gnaeus Servilius Geminus, in what is considered to be a rebuke of the Senate''s prosecution of the war. Flaminius raises new legions and marches north to meet the Carthaginian general Hannibal.','36.851829926','10.320498718','-217','0','0','-217-0-0 00:00:00.000000','-217-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(790,'Carthage','Cyprian, the bishop of Carthage, is martyred (decapitation).','36.851829926','10.320498718','258','0','0','258-0-0 00:00:00.000000','258-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(791,'Carthage','The Carthaginian general Hasdrubal is murdered by a Celtic assassin while campaigning to increase the Carthaginian hold on Spain. Following the assassination of Hasdrubal, Hannibal, the son of the Carthaginian general, Hamilcar Barca, is proclaimed commander-in-chief by the army and his appointment is confirmed by the Carthaginian government.','36.851829926','10.320498718','-221','0','0','-221-0-0 00:00:00.000000','-221-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(792,'Carthage','Pope Stephen I threatens to excommunicate Cyprian, bishop of Carthage, and other bishops in Africa and Asia Minor unless they stop rebaptizing heretics. Cyprian attacks the pope in a treatise which gains support from the Council of Carthage. He sends envoys to Rome, raising the specter of a schism between the Roman and Carthaginian Churches.','36.851829926','10.320498718','256','0','0','256-0-0 00:00:00.000000','256-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(793,'Carthage','The Greek merchants of Massilia, frightened by Carthaginian successes in Spain (including their exploitation of the Spanish silver mines), appeal to Rome. Rome makes an alliance with the independent Spanish port city of Saguntum south of the Ebro River.','36.851829926','10.320498718','-226','0','0','-226-0-0 00:00:00.000000','-226-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(794,'Carthage','The Romans send envoys to Massilia (modern Marseille, France) to negotiate with the Carthaginian general Hamilcar Barca who is based there.','36.851829926','10.320498718','-231','0','0','-231-0-0 00:00:00.000000','-231-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(795,'Carthage','Hamilcar Barca strikes at the supply lines of the mercenary army besieging Carthage, forcing them to cease the siege of the city. He then fights a series of running engagements with the mercenary armies, keeping them off-balance. Hamilcar manages to force the mercenary armies into a box canyon in the Battle of The Saw. The mercenaries are besieged in the canyon.','36.851829926','10.320498718','-238','0','0','-238-0-0 00:00:00.000000','-238-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(796,'Carthage','Concerned that Hamilcar Barca''s leniency in pardoning those who he has captured who have participated in the Mercenary War will encourage others to defect, Mathos and Spendius order the mutilation and execution of about seven hundred Carthaginian prisoners, including Gesco. With the mercenaries jointly guilty of these atrocities, defectors dare not face Carthaginian justice under Hamilcar.','36.851829926','10.320498718','-239','0','0','-239-0-0 00:00:00.000000','-239-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(797,'Carthage','March 10?The Carthaginian fleet sent to relieve the Roman blockade of the Sicilian cities of Lilybaeum and Drepanum is totally defeated near the Aegates Islands off western Sicily by the Roman fleet led by Roman consul and commander, Gaius Lutatius Catulus. The result is a decisive Roman victory which forces an end to the protracted First Punic War, to Rome''s distinct advantage.','36.851829926','10.320498718','-241','3','10','-241-3-10 00:00:00.000000','-241-3-10 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(798,'Carthage','The Romans, led by Lucius Caecilius Metellus, attack the Carthaginian held port city of Panormus after taking Kephalodon. After fierce fighting in the Battle of Panormus, the Carthaginians, led by Hasdrubal, are defeated and the city falls.','36.851829926','10.320498718','-251','0','0','-251-0-0 00:00:00.000000','-251-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(799,'Carthage','Dionysius I''s third war with Carthage proves disastrous. He suffers a crushing defeat at Cronium and is forced to pay an indemnity of 1,000 talents and cede the territory west of the Halycus River to the Carthaginians.','36.851829926','10.320498718','-378','0','0','-378-0-0 00:00:00.000000','-378-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(800,'Carthage','Rome aims for a quick end to hostilities in the First Punic War and decides to invade the Carthaginian colonies in Northern Africa to force the enemy to accept terms. A major fleet is built, including transports for the army and its equipment, and warships for their protection. Carthage under Hamilcar tries to intervene but a force under the Roman general and consul Marcus Atilius Regulus and his colleague Lucius Manlius Vulso Longus defeat the Carthaginian fleet in the Battle of Cape Ecnomus off the southern coast of Sicily.','36.851829926','10.320498718','-256','0','0','-256-0-0 00:00:00.000000','-256-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(801,'Carthage','The Romans are able to regain the initiative in Sicily against Carthage by retaking Enna and Camarina. In central Sicily, they take the town of Mytistraton, which they have attacked twice previously. The Romans also move in the north by marching across the northern coast toward Panormus, but are not able to take the city.','36.851829926','10.320498718','-258','0','0','-258-0-0 00:00:00.000000','-258-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(802,'Carthage','The Carthaginians under Hamilcar take advantage of their victory at Thermae in Sicily by counterattacking the Romans and seizing Enna. Hamilcar continues south to Camarina, in Syracusan territory, to try and convince the Syracusans to rejoin the Carthaginian side.','36.851829926','10.320498718','-259','0','0','-259-0-0 00:00:00.000000','-259-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(803,'Carthage','The Roman advance continues westward from Agrigentum with their forces relieving the besieged cities of Segesta and Macella. These cities have sided with the Roman cause, and have come under Carthaginian attack for doing so.','36.851829926','10.320498718','-260','0','0','-260-0-0 00:00:00.000000','-260-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(804,'Carthage','The Romans, determined to win control of Sicily from Carthage, build a fleet based on the model of a captured Carthaginian quinquereme.','36.851829926','10.320498718','-261','0','0','-261-0-0 00:00:00.000000','-261-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(805,'Carthage','Rome besieges the city of Agrigentum which is held by Carthage under the command of Hannibal Gisco. Rome''s siege involves both consular armies?a total of four Roman legions?and takes several months to resolve. The garrison of Agrigentum manages to call for reinforcements and a Carthaginian relief force commanded by Hanno comes to the rescue and destroys the Roman supply base at Erbessus. Nevertheless, after a few skirmishes, the battle of Agrigentum is fought and won by Rome, and the city falls. Gisco manages to escape to Carthage in the late stages of the battle.','36.851829926','10.320498718','-262','0','0','-262-0-0 00:00:00.000000','-262-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(806,'Carthage','Xerxes encourages the Carthaginians to attack the Greeks in Sicily. Under the Carthaginian military leader, Hamilcar, Carthage sends across a large army.','36.851829926','10.320498718','-480','0','0','-480-0-0 00:00:00.000000','-480-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(807,'Carthage','The tyrant of Syracuse, Hiero II, once more attacks the Mamertines. They ally themselves with a nearby Carthaginian fleet and hold off the Syracusans. However, when the Carthaginians do not leave, the Mamertines appeal to Rome for an alliance, hoping for more reliable protection. Although initially reluctant to assist lest it encourage other mercenary groups to mutiny, Rome is unwilling to see Carthaginian power spread further over Sicily and encroach on Italy. Rome therefore enters into an alliance with the Mamertines. By this action, the First Punic War begins and will embroil Rome in a conflict with Carthage that will continue for 23 years.','36.851829926','10.320498718','-264','0','0','-264-0-0 00:00:00.000000','-264-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(808,'Carthage','The Mamertines, a body of Campanian mercenaries who have been employed by Agathocles, the former tyrant of Syracuse, capture the stronghold of Messana (Messina in north-eastern Sicily), from which they harass the Syracusans. The Syracusan military leader, Hieron, defeats them in a pitched battle at the Longanus River near Mylae, but Carthaginian forces intervene to prevent him from capturing Messana. His grateful countrymen then choose Hieron as their king and tyrant, to be known as Hieron II.','36.851829926','10.320498718','-269','0','0','-269-0-0 00:00:00.000000','-269-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(809,'Carthage','Carthage, already in control of Sardinia, southern Spain and Numidia, is ruled by an oligarchy of merchants under two Suffetes or chief magistrates. While Carthage''s military commanders are strong, the state relies on mercenaries (including Spanish ones) for its soldiers.','36.851829926','10.320498718','-270','0','0','-270-0-0 00:00:00.000000','-270-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(810,'Carthage','Dionysius I of Syracuse, having increased his power over the native Sicilians (Sicels), is now attacked by a second Carthaginian expedition. He is forced to ally himself with the Sicels. The Carthaginian army, under Mago, is defeated, makes peace, and returns to Carthage. The treaty with Carthage is advantageous to Dionysius.','36.851829926','10.320498718','-392','0','0','-392-0-0 00:00:00.000000','-392-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(811,'Carthage','Pyrrhus negotiates with the Carthaginians to end the fighting between them in Sicily. The Carthaginians are inclined to come to terms with Pyrrhus, but he demands that Carthage abandon all of Sicily and make the Libyan Sea the boundary between Carthage and the Greeks. Meanwhile, he begins to display despotic behaviour towards the Sicilian Greeks and soon Sicilian opinion moves against him. Therefore, fearing that his successes in Sicily may lead him to become the despot of their country, the Syracusans ask Pyrrhus to leave Sicily. He does so, and returns to the Italian mainland, noting that he expects Sicily to be a fair wrestling ring for Carthage and Rome.','36.851829926','10.320498718','-276','0','0','-276-0-0 00:00:00.000000','-276-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(812,'Carthage','Pyrrhus captures Eryx, the strongest Carthaginian fortress in Sicily. This prompts the rest of the Carthaginian-controlled cities in Sicily to defect to Pyrrhus.','36.851829926','10.320498718','-277','0','0','-277-0-0 00:00:00.000000','-277-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(813,'Carthage','The Carthaginians and the Romans agree to support each other against a common foe. The Carthaginians give Rome money and ships in their fight against Pyrrhus, the king of Epirus.','36.851829926','10.320498718','-279','0','0','-279-0-0 00:00:00.000000','-279-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(814,'Carthage','The tyrant of Syracuse, Agathocles, dies after restoring the Syracusan democracy on his death bed, by stating that he does not want his sons to succeed him as king. However, the resulting dissension among his family about the succession leads to a renewal of Carthaginian power in Sicily.','36.851829926','10.320498718','-289','0','0','-289-0-0 00:00:00.000000','-289-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(815,'Carthage','Carthage''s Iberian colonies revolt and secede cutting off Carthage''s major supply of silver and copper. Hannibal Mago, the grandson of the Carthaginian general Hamilcar (who unsuccessfully invaded Sicily in 480 BC), begins preparations to reclaim Sicily.','36.851829926','10.320498718','-410','0','0','-410-0-0 00:00:00.000000','-410-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(816,'Carthage','A peace agreement is reached between Syracuse and Carthage. The peace restricts Carthaginian power in Sicily to the area west of the Halycus (Platani) River. This agreement allows the tyrant of Syracuse, Agathocles, to strengthen his rule over the Greek cities of Sicily.','36.851829926','10.320498718','-306','0','0','-306-0-0 00:00:00.000000','-306-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(817,'Carthage','The tyrant of Syracuse, Agathocles is forced to return to Syracuse to deal with growing unrest in his Sicilian dominions. Those of Agathocles'' army that remain behind in Carthage are soon destroyed.','36.851829926','10.320498718','-307','0','0','-307-0-0 00:00:00.000000','-307-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(818,'Carthage','The Carthaginians are forced to abandon their siege of Syracuse (begun in 398 BC), but destroy Messina. Dionysius'' first war with Carthage ends with a notable victory for Dionysius, who confines his enemy''s power to an area of northwest Sicily. On his return home, the Carthaginian general, Himilco, commits suicide.','36.851829926','10.320498718','-396','0','0','-396-0-0 00:00:00.000000','-396-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(819,'Carthage','Since 480 BC, an aristocratic Council of Elders has effectively ruled Carthage. The titular king of Carthage, Bomilcar, attempts a coup to restore the monarchy to full power. His attempt fails, which leads to Carthage becoming in name as well as in fact a republic.','36.851829926','10.320498718','-309','0','0','-309-0-0 00:00:00.000000','-309-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(820,'Carthage','The Carthaginian general Hamilcar crosses the Mediterranean with an army and wins Battle of Himera against the tyrant of Syracuse, Agathocles'' forces. Agathocles is then besieged in Syracuse.','36.851829926','10.320498718','-311','0','0','-311-0-0 00:00:00.000000','-311-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(821,'Carthage','The Syracusans ask for help against their tyrant Agathocles from the Carthaginians, who, fearing for their own possessions in Sicily, send a large force to the island.','36.851829926','10.320498718','-312','0','0','-312-0-0 00:00:00.000000','-312-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(822,'Carthage','Dionysius the Elder rises to power as the tyrant of Syracuse. He makes peace with the Carthaginian general, Hamilco (whose army has been weakened by the plague), and fortifies Syracuse. This treaty leaves Carthage in control of most of Sicily.','36.851829926','10.320498718','-405','0','0','-405-0-0 00:00:00.000000','-405-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(823,'Carthage','Scipio Aemilianus, victor of Carthage was assassinated by his enemies in Rome.','36.851829926','10.320498718','-129','0','0','-129-0-0 00:00:00.000000','-129-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(824,'Carthage','Carthage recalled from exile an able general, named Hasdrubal, who organized their solid defences. Against the 45-foot (13.7 m) city walls, the Romans made slow progress.','36.851829926','10.320498718','-147','0','0','-147-0-0 00:00:00.000000','-147-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(825,'Carthage','Scipio Aemilianus is sent by the Roman general, Lucius Licinius Lucullus, to Numidia to obtain some elephants from the Numidian king Masinissa, the friend of his grandfather Scipio Africanus. While there, he witnesses a great but indecisive battle between the Numidians and the Carthaginians. The latter then asks Scipio Aemilianus to arrange a settlement, but the negotiations break down.','36.851829926','10.320498718','-150','0','0','-150-0-0 00:00:00.000000','-150-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(826,'Carthage','The Carthaginian debt to Rome is fully repaid, meaning that, according to Carthage, the treaty with Rome, which was put in place at the end of the Second Punic War, is no longer in force. The Romans do not agree with this interpretation. Instead they view the treaty as a permanent declaration of Carthaginian subordination to Rome.','36.851829926','10.320498718','-151','0','0','-151-0-0 00:00:00.000000','-151-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(827,'Carthage','The Carthaginians again invade Sicily and attack Agrigentum (Acragas). Plague breaks out in their camp and Hannibal Mago dies. Himilco assumes command and captures Agrigentum (Acragas), Gela and Camarina. Gela is destroyed and its treasures sacked. The survivors take refuge in Syracuse. The plague is carried back to Carthage by its soldiers.','36.851829926','10.320498718','-406','0','0','-406-0-0 00:00:00.000000','-406-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(828,'Carthage','The Carthaginians, prevented by their treaty with Rome from engaging in armed resistance, but equally guaranteed against any loss of territory, appeal to Rome against the depredations of King Masinissa of Numidia. The Roman censor Marcus Porcius Cato heads a commission which arbitrates a truce between Carthage and her former ally, Masinissa.','36.851829926','10.320498718','-157','0','0','-157-0-0 00:00:00.000000','-157-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(829,'Casablanca','May 16 &ndash; In Casablanca, Morocco, 33 civilians are killed and more than 100 injured in the Casablanca terrorist attacks.','33.5333312','-7.583331','2003','5','16','2003-5-16 00:00:00.000000','2003-5-16 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(830,'Caucasus','The Kars?Tbilisi?Baku railway across the Caucasus is scheduled to be completed sometime in 2012. National Geographic'''', August 2010, page 62. <','42.25666564','44.119332856','2012','0','0','2012-0-0 00:00:00.000000','2012-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(831,'Caucasus','After turning aside south for 15 years to invade the Caucasus, Asia Minor and Persia{{mdash','42.25666564','44.119332856','1237','0','0','1237-0-0 00:00:00.000000','1237-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(832,'Caucasus','November 25 &ndash; A devastating earthquake rocks Caucasia, killing 80,000 people.','42.25666564','44.119332856','1667','11','25','1667-11-25 00:00:00.000000','1667-11-25 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(833,'Celje','The city walls and defensive moat are built in Celje, Slovenia.','46.234832394','15.267165598','1473','0','0','1473-0-0 00:00:00.000000','1473-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(834,'Chalcedon','The Persian Army, under the command of General Spahbodh Shaahin, conquers Chalcedon after a long siege.','40.9833294','29.0333332','617','0','0','617-0-0 00:00:00.000000','617-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "timeline_keeper_events" VALUES(835,'Chalcedon','Maurice, at war with the Avars and always dealing with the lack of money, decrees that the army should stay for winter beyond the Danube, which proves to be a serious mistake. The exhausted troops mutiny against the Emperor. Maurice and his family flee to Chalcedon, and Phocas is proclaimed emperor. Maurice and his sons are executed.','40.9833294','29.0333332','602','0','0','602-0-0 00:00:00.000000','602-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
