INSERT INTO "histories-original" VALUES(1,'2014-02-07 00:00:00.000000','2014-02-23 00:00:00.000000','Sochi Olympics','Winter Olympics in Sochi ','https://www.youtube.com/watch?v=qKByVp3gjJA','Closing Ceremony','Ura','2014-02-25 01:08:04.639226','2014-02-25 01:08:04.639226');
INSERT INTO "histories-all" VALUES(1,'Acajutla','June 8 &ndash; Spanish conquistador Pedro de Alvarado leads the Battle of Acajutla, defeating a battalion of Pipiles, in the neighborhoods of present day Acajutla, El Salvador','13.587330984','-89.833496666','1524','6','8','1524-6-8 00:00:00.000000','1524-6-8 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(2,'Achaea','Achaea, on the southern shore of the Corinthian Gulf, becomes part of what is effectively now the Athenian Empire. The Delian League had changed from an alliance into an empire clearly under the control of Athens.','38.0854196583','21.8558999097','-453','0','0','-453-0-0 00:00:00.000000','-453-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3,'Achaea','As strategos of the Achaeans, the Greek general Philopoemen is responsible for turning the Achaean League into an aggressive military power. He builds up the League''s military capability. The Achaean League''s army and cavalry under Philopoemen then defeat the Aetolians on the Elean frontier.','38.0854196583','21.8558999097','-209','0','0','-209-0-0 00:00:00.000000','-209-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(4,'Achaea','Macedonia''s King Antigonus II Gonatas has to deal with a rebellion by an Athenian-led coalition of Spartans (led by King Areus I of Sparta), Athenians (led by Chremonides), Arcadians and Achaeans that tries to expel the Macedonian forces located in Greece. The rebellion has the support of Ptolemy II of Egypt.','38.0854196583','21.8558999097','-267','0','0','-267-0-0 00:00:00.000000','-267-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(5,'Achaea','At Polybius'' request, Scipio Aemilianus manages to gain the support of the Roman statesman Cato the Elder (whose son has married Scipio''s sister Aemilia) for a proposal to release (and return to Greece) the 300 Achaean internees who are still being held without trial after being deported to Rome in 167 BC.','38.0854196583','21.8558999097','-151','0','0','-151-0-0 00:00:00.000000','-151-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(6,'Acrocorinth','Iphicrates also campaigns against Phlius and Arcadia, decisively defeating their armies and plundering the territory of the Arcadians when they refuse to engage his troops. After this victory, an Argive army marches to Corinth, and, seizing the Acrocorinth, effectively merges Argos and Corinth.','37.886829786','22.868496526','-391','0','0','-391-0-0 00:00:00.000000','-391-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(7,'Actium','Winter?Antony distributes garrisons along the west coast of Greece, stations the fleet at Actium and establishes his headquarters at Patrae.','38.953','20.768','-32','0','0','-32-0-0 00:00:00.000000','-32-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(8,'Actium','Antony alerted by Octavian''s presence, sets up camp on the southern shore, at the promontory of Actium. He dispatches a force to isolate the camp of Octavian in the valley of Louros.','38.953','20.768','-31','0','0','-31-0-0 00:00:00.000000','-31-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(9,'Aden','The British governor of Aden cancels the constitution and takes direct control of the protectorate, due to the bad security situation.','12.7999968','45.0333332','1965','9','24','1965-9-24 00:00:00.000000','1965-9-24 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(10,'Aden','April 2 &ndash; A United Nations delegation arrives in Aden due to approaching independence. They leave April 7, accusing British authorities of lack of cooperation. The British say the delegation did not contact them.','12.7999968','45.0333332','1967','4','2','1967-4-2 00:00:00.000000','1967-4-2 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(11,'Aegina','The Athenian soldier and statesman, Aristides, as well as the former Athenian archon Xanthippus, return from banishment in Aegina to serve under Themistocles against the Persians.','37.749997','23.4333316','-480','0','0','-480-0-0 00:00:00.000000','-480-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(12,'Aegina','Aegina joins the Peloponnesian alliance, but their combined fleet is defeated by the Athenians in the Battle of Aegina. The Athenians, under the command of Leosthenes, land on the island of Aegina and besiege and defeat the city. Aegina is forced to pay tribute to Athens.','37.749997','23.4333316','-458','0','0','-458-0-0 00:00:00.000000','-458-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(13,'Aegina','The Spartans, led by King Archidamus II, invade Attica effectively starting the Second Peloponnesian War between the Athenian Empire and the Peloponnesian League. The Spartans lay waste to the countryside around Athens. Athenian leader, Pericles, does not seriously oppose them, rather withdrawing the rural population of the country districts within Athens'' city walls. Instead, he pursues active naval warfare and reduces any danger from the island of Aegina by replacing its native population with Athenians.','37.749997','23.4333316','-431','0','0','-431-0-0 00:00:00.000000','-431-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(14,'Aegina','Pericles, concerned over the draining effect of years of war on Athenian manpower, looks for peace with the support of the Assembly. Athenian diplomat, Callias, goes to Sparta and after much bargaining arranges a peace treaty with Sparta and her Peloponnesian allies, thus extending the 5 years truce of 451 BC for another 30 years. According to this treaty, Megara is to be returned to the Peloponnesian League, Troezen and Achaea become independent, Aegina is to become a tributary to Athens but autonomous, and disputes are to be settled by arbitration. Each party agrees to respect the alliances of the other.','37.749997','23.4333316','-445','0','0','-445-0-0 00:00:00.000000','-445-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(15,'Aegina','Athens goes on to defeat Aegina later in the year, and to finish the construction of the Long Walls to the Athenian port of Piraeus (an action opposed by Sparta).','37.749997','23.4333316','-457','0','0','-457-0-0 00:00:00.000000','-457-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(16,'Aegina','The Corinthians, upset by Athens? actions, lobbies Sparta to take action against Athens. This appeal is backed by Megara (which is being severely affected by Pericles'' economic sanctions) and by Aegina (which is being heavily taxed by Pericles and which has been refused home rule).','37.749997','23.4333316','-433','0','0','-433-0-0 00:00:00.000000','-433-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(17,'Aegina','A sculpture of a ''''Dying warrior'''' is made in the left corner of the east pediment of the Temple of Aphaea in Aegina (approximate date). Today, it is preserved at the ''''Staatliche Antikensammlungen und Glyptothek'''' in Munich, Germany.','37.749997','23.4333316','-480','0','0','-480-0-0 00:00:00.000000','-480-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(18,'Aegina','The island of Aegina and the city of Athens go to war. The island has earned the enmity of Athens by earlier submitting to the Persians. The Spartan King, Leotychidas, tries unsuccessfully to arrange a truce in the war.','37.749997','23.4333316','-487','0','0','-487-0-0 00:00:00.000000','-487-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(19,'Aegina','The Acarnanians, with Macedonian support, invade Attica, causing Athens, which has previously maintained its neutrality, to seek help from the enemies of Philip. Attalus I of Pergamum, who is with his fleet at Aegina, receives an embassy from Athens asking him to come to the city for consultations. After he is told that Roman ambassadors are also in Athens, Attalus goes there in haste.','37.749997','23.4333316','-200','0','0','-200-0-0 00:00:00.000000','-200-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(20,'Aegospotami','The defeat gives the enemies of Alcibiades an excuse to strip him of his command. He never returns again to Athens. He sails north to land he owned in the Thracian Chersonese. Except for a brief appearance at Aegospotami, Alcibiades'' involvement in the Peloponnesian War is over.','40.3584418996','26.625164166','-407','0','0','-407-0-0 00:00:00.000000','-407-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(21,'Aegospotami','Emerging after the Spartan victory at Aegospotami, the former Athenian leader, Alcibiades, takes refuge in Phrygia in northwestern Asia Minor with the Persian satrap, Pharnabazus, and seeks their assistance for the Athenians. The Spartans discover his plans and arrange with Pharnabazus to have him assassinated.','40.3584418996','26.625164166','-404','0','0','-404-0-0 00:00:00.000000','-404-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(22,'Afabet','March 20 &ndash; Eritrean War of Independence: Having defeated the Nadew Command, the EPLF enters the town of Afabet, victoriously concluding the Battle of Afabet.','16.1833326','38.6833306','1988','3','20','1988-3-20 00:00:00.000000','1988-3-20 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(23,'Ahmedabad','February 28 &ndash; Gujarat communal riots begin, wherein the Gulbarg Society massacre takes place in Ahmedabad, in which 69 people were burnt alive or killed.','23.03','72.58','2002','2','28','2002-2-28 00:00:00.000000','2002-2-28 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
