INSERT INTO "histories-all" VALUES(80,'Alexandria','Alexandria is recaptured by the Arabs after a Byzantine attempt to retake Egypt fails, ending nearly 10 centuries of Greaco-Roman civilization in Egypt.','31.198','29.9192','646','0','0','646-0-0 00:00:00.000000','646-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(81,'Alexandria','Panic strikes Rome as adverse winds delay grain shipments  from Africa and Egypt, producing a bread shortage. Ships laden with wheat from North Africa sail 300 miles to Rome''s port of Ostia in 3 days, and the 1,000 mile voyage from Alexandria averages 13 days. The vessels often carry 1,000 tons each to provide the city with 8,000 tons per week it normally consumes.','31.198','29.9192','70','0','0','70-0-0 00:00:00.000000','70-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
