INSERT INTO "histories-all" VALUES(83,'Alexandria','A 110 metre tall lighthouse on the island of Pharos in Alexandria''s harbour is completed and serves as a landmark for ships in the eastern Mediterranean. Built by Sostratus of Cnidus for Ptolemy II of Egypt, it is one of the seven wonders of the ancient world. It is a technological triumph and is the archetype of all lighthouses since. A broad spiral ramp leads to the top, where a fire burns at night.','31.198','29.9192','-285','0','0','-285-0-0 00:00:00.000000','-285-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(84,'Alexandria','Vespasian is joined by his son Titus, who brings Legio XV Apollinaris from Alexandria. By late spring the Roman army numbers more than 60,000 soldiers, including auxiliaries and troops of king Agrippa II.','31.198','29.9192','67','0','0','67-0-0 00:00:00.000000','67-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(85,'Alexandria','Following the Battle of Corupedium, Lysimachus'' widow, Arsinoe, flees to Cassandrea, a city in northern Greece, where she marries her half-brother Ptolemy Keraunos. This proves to be a serious misjudgement, as Ptolemy Keraunus promptly kills two of her sons, though the third is able to escape. Arsinoe flees again, this time to Alexandria in Egypt.','31.198','29.9192','-281','0','0','-281-0-0 00:00:00.000000','-281-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(86,'Alexandria','Autumn?The Donations of Alexandria: Antony distributes the eastern kingdoms as a gift to the children of Cleopatra VII of Egypt; he declared Caesarion, Caesar''s legitimate son as co-ruler of Egypt and Cyprus.  Alexander Helios received Armenia and Media, to Cleopatra Selene he gives the kingdoms of Cyrenaica and Libya. His youngest son Ptolemy Philadelphus received the Egyptian possessions in Phoenicia, Syria and Cilicia. Antony established Cleopatra as a Hellenistic monarch at Alexandria and gives her the title of Queen of Kings.','31.198','29.9192','-34','0','0','-34-0-0 00:00:00.000000','-34-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
