INSERT INTO "histories-all" VALUES(99,'Americas','August &ndash; Captain Jope''s ship brings the first Africans to what will later be called America. Jope trades these Africans for food and supplies. This trade of Africans is as temporary indentured servants in the same way that English whites are owned as laborers in the New World. Because the Spanish had Christianized these Africans, this labor arrangement is for a specified time and then they are free to live their lives, just as the English laborers are. These Africans had been stolen from the cargo of a Spanish vessel on the high seas. The enslavement of Africans in America is progressively and intentionally implemented later, beginning with the sentencing of John Punch in 1640.','19','-96','1619','8','0','1619-8-0 00:00:00.000000','1619-8-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
