INSERT INTO "histories-all" VALUES(113,'Anatolia','Seleucus II Callinicus'' mother, Laodice attempts to take control over the Seleucid Empire by insisting that Seleucus II make his younger brother, Antiochus Hierax, co-regent and give him all the Seleucid territory in Anatolia. Antiochus promptly declares independence and begins fighting a war with his brother.','39','32','-246','0','0','-246-0-0 00:00:00.000000','-246-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
