INSERT INTO "histories-all" VALUES(115,'Anatolia','With the increasingly real threat to his Empire from the Romans, Antiochus III is eager to negotiate on the basis of Rome''s previous demands, but the Romans insist that he first give up the region west of the Taurus Mountains. When Antiochus refuses, the Battle of Magnesia is fought near Magnesia ad Sipylum, on the plains of Lydia in Anatolia, between the Romans, led by the consul Lucius Cornelius Scipio and his brother, Scipio Africanus, with their ally Eumenes II of Pergamum, and the army of Antiochus III the Great of the Seleucid Empire. The resulting decisive Roman victory ends the conflict with the Seleucids for the control of Greece.','39','32','-190','0','0','-190-0-0 00:00:00.000000','-190-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
