INSERT INTO "histories-all" VALUES(123,'Anatolia','When the Ionian Greeks in Asia Minor rebelled against Persia in 499 BC, Eretria joined Athens in sending aid to the rebels. As a result, Darius makes a point of punishing Eretria during his invasion of Greece. The city is sacked and burned and Darius enslaves its inhabitants. He intends the same fate for Athens.','39','32','-490','0','0','-490-0-0 00:00:00.000000','-490-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
