INSERT INTO "histories-all" VALUES(133,'Anatolia','Antiochus III''s army crosses the Hellespont into Thrace, where he claims sovereignty over territory that has been won by Seleucus I in 281 BC. A war of harassment and diplomacy with Rome ensues. The Romans send ambassadors demanding that Antiochus stay out of Greece and set free all the autonomous communities in Anatolia. To meet these demands would have meant Antiochus III giving up the western part of his Seleucid Empire. Thus Antiochus refuses the Romans'' demands.','39','32','-196','0','0','-196-0-0 00:00:00.000000','-196-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
