INSERT INTO "histories-all" VALUES(515,'Biskra','Severus launches a campaign in Africa, Legio III ''''Augusta'''' under Quintus Anicius Faustus fights a guerrilla war against the Garamantes along the Limes Tripolitanus. They capture several settlements such as Cydamus, Gholaia and their capital Garama, 600 km south of Lepcis Magna. The province of Numidia is enlarged: the Romans annexed Castellum Dimmidi, Gemellae and Vescera.','34.8499966','5.7333304','202','0','0','202-0-0 00:00:00.000000','202-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
