INSERT INTO "histories-all" VALUES(518,'Boeotia','Athens arranges an alliance with Euboea, Megara, Achaea, Corinth, Acarnania and some other states in the Peloponnesus. However, the most desirable ally for Athens is Thebes. Therefore, the Athenian leader, Demosthenes, goes to the Boeotian city and secures an alliance with Thebes despite the efforts of a Macedonian deputation to persuade Thebes to join with Macedonia. In return, Athens agrees to Thebes'' controlling Boeotia, Thebes being in command solely on land and jointly at sea, and Athens paying two thirds of the campaign''s cost.','38.8999964','22.5333312','-338','0','0','-338-0-0 00:00:00.000000','-338-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(519,'Boeotia','The young and popular Alcibiades is elected Strategos (one of a board of ten generals) and begins to dominate Athenian life and politics. A Quadruple Alliance of Athens, Argos, Mantineia and Elis, which has been organised by Alcibiades (in opposition to Nicias) confronts a Spartan-Boeotian alliance.','38.8999964','22.5333312','-420','0','0','-420-0-0 00:00:00.000000','-420-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(520,'Boeotia','Nicias, the leader of the aristocratic and peace party in Athens and Pleistoanax, King of Sparta, negotiate the Peace of Nicias between Athens and Sparta, which brings a temporary end to the Peloponnesian War. The essence of the Peace of Nicias is a return to the prewar situation: most wartime gains are to be returned. Seventeen representatives from each side swear an oath to uphold the treaty, which is meant to last for thirty years or one generation (meaning they are not responsible for the next generation''s decision). All of Sparta''s allies agree to sign the peace, except for the Boeotians, Corinth, Elis, and Megara.','38.8999964','22.5333312','-421','0','0','-421-0-0 00:00:00.000000','-421-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(521,'Boeotia','Ephialtes is murdered by Aristodicus of Tanagra in Boeotia, who is said to have acted on behalf of members of the Athenian oligarchy.','38.8999964','22.5333312','-461','0','0','-461-0-0 00:00:00.000000','-461-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(522,'Boeotia','The Phocians capture and sack Delphi in whose territory the famous temple and oracle stand. A ''''sacred war'''' is declared against them by the other members of the Great Amphictyonic League. The Phocians, led by two capable generals, Philomelus and Onomarchus, use Delphi''s riches to hire a mercenary army to carry the war into Boeotia and Thessaly.','38.8999964','22.5333312','-356','0','0','-356-0-0 00:00:00.000000','-356-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(523,'Boeotia','The Theban general, Epaminondas, makes a bold attempt to challenge Athens'' naval empire. With a new Boeotian fleet, he sails to Byzantium, with the result that a number of cities in the Athenian Empire rebel against their now threatened masters.','38.8999964','22.5333312','-363','0','0','-363-0-0 00:00:00.000000','-363-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(524,'Boeotia','On the advice of the city''s military leader, Epaminondas, Thebes builds a fleet of 100 triremes to help combat Athens. Thebes destroys its Boeotian rival Orchomenus.','38.8999964','22.5333312','-364','0','0','-364-0-0 00:00:00.000000','-364-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(525,'Boeotia','27 August &ndash; The Battle of Plataea in Boeotia ends the Persian invasions of Greece as the Persian general Mardonius is routed by the Greeks under Pausanias, nephew of the former Spartan King, Leonidas I. The Athenian contingent is led by the repatriated Aristides. Mardonius is killed in the battle and the Greeks capture enormous amounts of loot. Thebes is captured shortly thereafter and the Theban collaborators executed by Pausanias.','38.8999964','22.5333312','-479','0','0','-479-0-0 00:00:00.000000','-479-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(526,'Boeotia','A fresh peace congress is summoned at Sparta. At the peace conference, the Spartan King Agesilaus II (with the support of Athens) refuses to allow the Thebans to sign the treaty on behalf of all Boeotia. The Theban statesman Epaminondas, who is boeotarch (one of the five magistrates of the Boeotian federation), maintains Thebes'' position, even when it leads to the exclusion of Thebes from the peace treaty.','38.8999964','22.5333312','-371','0','0','-371-0-0 00:00:00.000000','-371-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(527,'Boeotia','Learning that the Spartan garrison of Orchomenus (in Boeotia) is leaving for an expedition to Locris, Pelopidas sets out with the Sacred Band of Thebes and a small force of cavalry, intending to seize the city while it is unguarded. However, as the Thebans approach the city, they learn that a sizable force has been dispatched from Sparta to reinforce the garrison at Orchomenus and is approaching the city. Pelopidas retreats with his force, but before the Thebans can reach safety at Tegyra, they meet the original Spartan garrison returning from Locris. In the ensuing Battle of Tegyra, the Thebans rout the larger Spartan force.','38.8999964','22.5333312','-375','0','0','-375-0-0 00:00:00.000000','-375-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(528,'Boeotia','The Thebans are able to reconstitute their old Boeotian confederacy in a new, democratic form. The cities of Boeotia unite as a federation with an executive body composed of seven generals, or Boeotarchs, elected from seven districts throughout Boeotia.','38.8999964','22.5333312','-379','0','0','-379-0-0 00:00:00.000000','-379-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(529,'Boeotia','The Spartan commander Phoebidas, who is passing through Boeotia on campaign, takes advantage of civil strife within Thebes to gain entrance to the city for his troops. Once inside, he seizes the Cadmeia (the citadel of Thebes), and forces the anti-Spartan party to flee the city. The government of Thebes is placed in the hands of the pro-Spartan party, backed by a Spartan garrison based in the Cadmeia. Many of the previous leaders of Thebes are driven into exile. Epaminondas, although associated with the anti-Spartan faction, is allowed to remain.','38.8999964','22.5333312','-383','0','0','-383-0-0 00:00:00.000000','-383-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
