INSERT INTO "histories-all" VALUES(531,'Boeotia','While Demetrius Poliorcetes is campaigning in Boeotia, he receives news that Lysimachus, the ruler of Thrace, has been taken prisoner by Dromichaetes. Hoping to seize Lysimachus''s territories in Thrace, Demetrius, delegates command of his forces in Boeotia to his son, Antigonus and immediately marches north. However, while he is away, the Boeotians rise in rebellion, but are defeated by Antigonus, who bottles them up in the city of Thebes.','38.8999964','22.5333312','-292','0','0','-292-0-0 00:00:00.000000','-292-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(532,'Boeotia','The Spartans arrange for two armies, one under the Spartan general Lysander and the other under the Spartan King Pausanias, to rendezvous at and attack the Boeotian city of Haliartus. Lysander, arriving before Pausanias, persuades the city of Orchomenus to revolt from the Boeotian confederacy, and then advances to Haliartus with his troops. There, he is killed after bringing his forces too near the walls of the city.','38.8999964','22.5333312','-395','0','0','-395-0-0 00:00:00.000000','-395-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
