INSERT INTO "histories-all" VALUES(740,'Cappadocia','Pharnaces I of Pontus decides to attack both Eumenes II of Pergamum and Ariarathes IV of Cappadocia and therefore invades Galatia with a large force. Eumenes leads an army to oppose him, however, hostilities are soon suspended following the arrival of Roman deputies, who have been appointed by the Roman Senate to inquire into the matters in dispute. Negotiations take place at Pergamum but are inconclusive, with Pharnaces'' demands being rejected by the Romans as unreasonable. As a consequence, the war between Pontus and Pergamum and Cappadocia is renewed.','38.668997324','34.836829986','-181','0','0','-181-0-0 00:00:00.000000','-181-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(741,'Cappadocia','King Ardashir I, ruler of the Persia, invades the Roman province of Mesopotamia and unsuccessfully besiege the fortress town of Nisibis (Turkey). His army threatens the border outposts of Syria and Cappadocia.','38.668997324','34.836829986','230','0','0','230-0-0 00:00:00.000000','230-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(742,'Cappadocia','June 8?Battle of Antioch: Elagabalus defeats with support of the Syrian legions the forces of Macrinus. He flees, but is captured near Chalcedon and later executed in Cappadocia.','38.668997324','34.836829986','218','6','8','218-6-8 00:00:00.000000','218-6-8 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
