INSERT INTO "histories-all" VALUES(824,'Carthage','Carthage recalled from exile an able general, named Hasdrubal, who organized their solid defences. Against the 45-foot (13.7 m) city walls, the Romans made slow progress.','36.851829926','10.320498718','-147','0','0','-147-0-0 00:00:00.000000','-147-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(825,'Carthage','Scipio Aemilianus is sent by the Roman general, Lucius Licinius Lucullus, to Numidia to obtain some elephants from the Numidian king Masinissa, the friend of his grandfather Scipio Africanus. While there, he witnesses a great but indecisive battle between the Numidians and the Carthaginians. The latter then asks Scipio Aemilianus to arrange a settlement, but the negotiations break down.','36.851829926','10.320498718','-150','0','0','-150-0-0 00:00:00.000000','-150-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(826,'Carthage','The Carthaginian debt to Rome is fully repaid, meaning that, according to Carthage, the treaty with Rome, which was put in place at the end of the Second Punic War, is no longer in force. The Romans do not agree with this interpretation. Instead they view the treaty as a permanent declaration of Carthaginian subordination to Rome.','36.851829926','10.320498718','-151','0','0','-151-0-0 00:00:00.000000','-151-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(827,'Carthage','The Carthaginians again invade Sicily and attack Agrigentum (Acragas). Plague breaks out in their camp and Hannibal Mago dies. Himilco assumes command and captures Agrigentum (Acragas), Gela and Camarina. Gela is destroyed and its treasures sacked. The survivors take refuge in Syracuse. The plague is carried back to Carthage by its soldiers.','36.851829926','10.320498718','-406','0','0','-406-0-0 00:00:00.000000','-406-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(828,'Carthage','The Carthaginians, prevented by their treaty with Rome from engaging in armed resistance, but equally guaranteed against any loss of territory, appeal to Rome against the depredations of King Masinissa of Numidia. The Roman censor Marcus Porcius Cato heads a commission which arbitrates a truce between Carthage and her former ally, Masinissa.','36.851829926','10.320498718','-157','0','0','-157-0-0 00:00:00.000000','-157-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
