INSERT INTO "histories-all" VALUES(837,'Chang''an','Due to a culmination of major droughts, floods, locust plagues, and epidemics, a widespread famine breaks out in the dual Chinese capital cities of Chang''an (primary capital) and Luoyang (secondary capital). The scarcity of food drives the price of grain to unprecedented heights, ending a once prosperous era under emperors Taizong and Gaozong on a sad note.','34.2666656','108.8999964','682','0','0','682-0-0 00:00:00.000000','682-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
