INSERT INTO "histories-all" VALUES(843,'Chang''an','April 5?During the Cold Food Festival, Chinese Emperor Zhongzong of Tang has his chief ministers of court, sons-in-law, and high ranking military officers engage in the festive game of tug of war within a palace of Chang''an City. The Emperor purportedly laughs when two older ministers fall over during the game.','34.2666656','108.8999964','710','4','5','710-4-5 00:00:00.000000','710-4-5 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(844,'Chang''an','Emperor Xuanzong of Tang starts to rule in Ancient China. He liquidates the highly lucrative Inexhaustible Treasury, which is run by a prominent Buddhist monastery in Chang''an. This monastery collects vast amounts of money, silk, and treasures through multitudes of rich people''s repentances, left on the premises anonymously. Although the monastery is generous in donations, Emperor Xuanzong issues a decree abolishing their treasury on the grounds that their banking practices were fraudulent, collects their riches, and distributes the wealth to various other Buddhist monasteries, Daoist abbeys, and to repair statues, halls, and bridges in the city.','34.2666656','108.8999964','713','0','0','713-0-0 00:00:00.000000','713-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
