INSERT INTO "histories-all" VALUES(852,'Chang''an','In the Chinese capital of Chang''an, the West Market and East Market are closed every night 1 hour and three quarters before dusk (by government-ordered curfew), yet night markets thrive in residential areas. The local government attempt to shut the night markets down in this year, but with the decline of the government''s authority by the mid 9th century, this edict (like many others) is largely ignored as urban dwellers keep attending the night markets regardless.','34.2666656','108.8999964','841','0','0','841-0-0 00:00:00.000000','841-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
