INSERT INTO "histories-all" VALUES(873,'China','The first in a decade-long series of severe famines and epidemics sweep central and southeastern China during the Ming Dynasty, made worse by a previous decision in 1527 to cut back on the intake of grain quotas for granaries.','35','105','1538','0','0','1538-0-0 00:00:00.000000','1538-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(874,'China','May 14 &ndash; Mikhail Gorbachev visits China, the first Soviet leader to do so since the 1960s.','35','105','1989','5','14','1989-5-14 00:00:00.000000','1989-5-14 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(875,'China','The ''''Book of Jin'''' is compiled in China during the Tang Dynasty. Its chief editor is the Chancellor Fang Xuanling, who dies in this year as well.','35','105','648','0','0','648-0-0 00:00:00.000000','648-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(876,'China','Pirooz, the son of the last Sassanid king of Persia, flees to Tang Dynasty China.','35','105','643','0','0','643-0-0 00:00:00.000000','643-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(877,'China','The Hongwu Emperor of the Ming Dynasty in China introduces the census registration system of ''''lijia'''', or the hundreds-and-tithing system, throughout the Yangzi valley. This system groups households into units of ten and groups of one hundred, whereupon their capacities for paying taxes and providing the state with corv�e labor service can be assessed. The system becomes fully operational in 1381, when it counts 59,873,305 people living in China (the historian Timothy Brook asserts that the number was much higher, somewhere between 65 million and 75 million).','35','105','1371','0','0','1371-0-0 00:00:00.000000','1371-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(878,'China','The Xumi Pagoda of Zhengding, China, is built during the reign of Emperor Taizong of Tang.','35','105','636','0','0','636-0-0 00:00:00.000000','636-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
