INSERT INTO "histories-all" VALUES(880,'China','The Xianbei/Tibetan state of Tuyuhun is invaded by Tang Dynasty China during Emperor Taizong''s campaign against Tuyuhun, led by commander Li Jing, resulting in the assassination of their leader (Busabuo Khan Murong Fuyun) in 635 and the dissolving of their state in 672.','35','105','634','0','0','634-0-0 00:00:00.000000','634-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(881,'China','In the Lao kingdom of Muang Sua, King Panya Leng is overthrown in a coup d''etat led by his son Panya Khamphong, which is likely to have been supported by the regionally dominant Mongol Yuan dynasty of China.','35','105','1286','0','0','1286-0-0 00:00:00.000000','1286-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(882,'China','June 10 &ndash; An earthquake-caused landslide dam on the Dadu River gives way, killing 100,000 in the Sichuan province of China.','35','105','1786','6','10','1786-6-10 00:00:00.000000','1786-6-10 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(883,'China','The tax census of the Sui Dynasty government in China records roughly 9 million registered households in the empire, a population size of roughly 50 million people.','35','105','609','0','0','609-0-0 00:00:00.000000','609-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
