INSERT INTO "histories-all" VALUES(885,'China','In China, the Tang Dynasty Buddhist monk, astronomer, and mechanical engineer Yi Xing applies a clockwork escapement mechanism to provide rotating motion to his astronomical armillary sphere.','35','105','725','0','0','725-0-0 00:00:00.000000','725-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(886,'China','Following the assassination of his rival Song Jiaoren, Yuan Shikai uses military force to dissolve China''s parliament and rules as a dictator.','35','105','1913','0','0','1913-0-0 00:00:00.000000','1913-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(887,'China','In China, Emperor Xiaojing succeeds Emperor Xiaoming as ruler of the Nan Liang Dynasty.','35','105','585','0','0','585-0-0 00:00:00.000000','585-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(888,'China','Although sparse maritime trade existed since its founding, the Ming Dynasty government of China officially revokes the ''''hai jin'''' maritime trade ban, reinstating foreign trade with all countries except Japan.','35','105','1567','0','0','1567-0-0 00:00:00.000000','1567-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(889,'China','The Sui Dynasty replaces the Northern Zhou Dynasty, the last of the Northern Dynasties in China. First ruler of the Sui Dynasty is Sui Wen Di.','35','105','581','0','0','581-0-0 00:00:00.000000','581-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(890,'China','The Ming Dynasty government of China greatly reduces the quotas for taking grain, severely diminishing the state''s capacity to relieve famines through a previously successful granary system.','35','105','1527','0','0','1527-0-0 00:00:00.000000','1527-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(891,'China','In Henan province of China, during the mid Ming Dynasty, a vast drought deprives the region of harvests for the next two years, killing off half the people in some communities due to starvation and cannibalism, as reported by local gazeteers.','35','105','1528','0','0','1528-0-0 00:00:00.000000','1528-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
