INSERT INTO "histories-all" VALUES(893,'China','Hong Taiji, Emperor of the Qing Dynasty of the Manchu dies and is succeeded by his 5-year-old son, the later Shunzhi Emperor of China.','35','105','1643','0','0','1643-0-0 00:00:00.000000','1643-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(894,'China','The Chinese polymath statesman and scientist Su Song has the successful pilot model for his astronomical clock tower constructed in Kaifeng, China. It features an escapement mechanism and the world''s oldest known endless power-transmitting chain drive to operate the armillary sphere, opening doors, and mechanical-driven manikins that would rotate in shifts to announce the time on plaques.','35','105','1088','0','0','1088-0-0 00:00:00.000000','1088-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
