INSERT INTO "histories-all" VALUES(900,'China','The Manchu tribal leader Nurhaci breaks his relations with the Ming Dynasty of China, then under the aloof and growingly negligent Wanli Emperor; Nurhaci''s line later becomes the emperors of the Qing Dynasty that overthrow the short-lived Shun Dynasty in 1644 and the remnants of the Ming throne in 1662.','35','105','1610','0','0','1610-0-0 00:00:00.000000','1610-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(901,'China','Chinese chronicles record a memorial sent by the King of Japan (possibly Emperor Y?ryaku), who describes himself as Supreme Director of Military Affairs in Japan and Korea to the Court of the Northern Wei Dynasty. The Chinese Emperor responds by confirming the Japanese dynasty in those titles. This is the earliest verifiable date in Japanese history.','35','105','478','0','0','478-0-0 00:00:00.000000','478-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(902,'China','Emperor Xianwen, Retired Emperor of the Chinese/Xianbei Northern Wei dynasty, is murdered by Empress Feng, who then assumes regency over young Emperor Xiaowen','35','105','476','0','0','476-0-0 00:00:00.000000','476-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(903,'China','Gaspar da Cruz, a Portuguese Dominican friar, writes about his travels to the Ming Dynasty of China; in this year he writes about the Chinese civil service handbook ''''The Bureaucratic System of the Ming Dynasty'''', and how the Chinese draw lots to determine which days of the year are most auspicious or most ill-fated to travel upon.','35','105','1575','0','0','1575-0-0 00:00:00.000000','1575-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
