INSERT INTO "histories-all" VALUES(905,'China','January 23?In China, the war elephant corps of the Southern Han are soundly defeated at Shao by crossbow fire from Song Dynasty troops. The Southern Han state is forced to submit to the Song Dynasty, ending not only Southern Han rule, but also the first regular war elephant corps employed in a Chinese army that had gained the Southern Han victories throughout the 10th century.','35','105','971','1','23','971-1-23 00:00:00.000000','971-1-23 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(906,'China','According to Wang Yangming (1472?1529), the Ming Dynasty philosopher and governor of Jiangxi, China, he intends to use ''''fo?lang?ji'''' cannons in suppressing the rebellion of Prince Zhu Chenhao in this year. This is most likely the earliest reference in China to the breech-loading Frankish culverin.','35','105','1519','0','0','1519-0-0 00:00:00.000000','1519-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
