INSERT INTO "histories-all" VALUES(911,'China','September 4 &ndash; Japan and China sign the Jiandao/Gando Treaty, which gives Imperial Japan a way to receive railroad concessions in Manchuria.','35','105','1909','9','4','1909-9-4 00:00:00.000000','1909-9-4 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
