INSERT INTO "histories-all" VALUES(915,'China','The Chinese Buddhist monk Huiyuan, who founded the Pure Land Buddhism sect and the monastery on Mount Lushan, writes the book ''''On Why Monks Do Not Bow Down Before Kings'''' in this year. In his book he argues that although the Buddhist clergy should remain independent and undisturbed by politics, the Buddhist laymen nonetheless make good subjects under monarchs, due to their fear of retribution of karma and desire to be reborn in paradise.','35','105','404','0','0','404-0-0 00:00:00.000000','404-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
