INSERT INTO "histories-all" VALUES(923,'China','Chinese painter Gu Kaizhi paints his work, ''''The Goddess of the Lo River''''.','35','105','377','0','0','377-0-0 00:00:00.000000','377-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
