INSERT INTO "histories-all" VALUES(925,'China','Chang''an, the capital of China, is thought to become the largest city in the world at the time, taking over from Pataliputra, the capital of the Mauryan empire.','35','105','-195','0','0','-195-0-0 00:00:00.000000','-195-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
