INSERT INTO "histories-all" VALUES(936,'China','August 11 &ndash; While conducting a siege against the Song Dynasty city known as Fishing Town in the province of Chongqing, China, the Mongol Khagan, Mongke Khan, dies in the nearby hills. Persian, Chinese, and Mongol records have different accounts of how he died, including succumbing to an arrow wound received by a Chinese archer in the siege, dysentery, and even a cholera epidemic. His death sparks a succession crisis in the Mongol Empire, while his brothers Ariq B�ke and Kublai soon convene their own kuriltai to elect themselves as the next Khan of Khans, opening the path to a four?year-long civil war from 1260 to 1264. In the end, Ariq B�ke surrenders to Kublai.','35','105','1259','0','0','1259-0-0 00:00:00.000000','1259-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
