INSERT INTO "histories-all" VALUES(991,'China','Kublai Khan, who became a Khagan claimant in the previously year, releases 75 Song Dynasty Chinese merchants from captivity after they had been captured along the border of his Empire and the Southern Song Dynasty of China. This is an act to increase his reputation amongst the Chinese, shore up his legitimacy as a just ruler, and to gain more defectors from the Southern Song Dynasty.','35','105','1261','0','0','1261-0-0 00:00:00.000000','1261-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
