INSERT INTO "histories-all" VALUES(1002,'China','The first reference to the windmill in Europe is made by a Dean Herbert of East Anglia, whose mills are supposedly in competition with the abbey of Bury St Edmunds.  This is probably an invention imported from interaction with the Muslim world, since the first windmills were most likely innovated from the Bana Musa brothers in the Islamic Middle East during the middle 9th century.  The windmill will spread in the other direction, to be introduced to China by as early as 1219.','35','105','1191','0','0','1191-0-0 00:00:00.000000','1191-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
