INSERT INTO "histories-all" VALUES(1100,'Constantinople','November 12?The Sixth Ecumenical Council opens in Constantinople and ends September 16, 681.','41.01224','28.976018','680','11','12','680-11-12 00:00:00.000000','680-11-12 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1101,'Constantinople','The plague appears suddenly in the Egyptian port of Pelusium, spreading the following year to Constantinople as the Justinianic plague. This was the beginning of a 200-year long pandemic that would devastate Europe, the Middle East, and northern Africa.','41.01224','28.976018','541','0','0','541-0-0 00:00:00.000000','541-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1102,'Constantinople','September 17?Martin I arrives in Constantinople, where he is eventually deposed as pope by the emperor Constans II.','41.01224','28.976018','654','9','17','654-9-17 00:00:00.000000','654-9-17 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1103,'Constantinople','After the death of emperor Theodosius I, the Empire is re-divided into an eastern and a western half. The eastern half is centered in Constantinople under Arcadius, son of Theodosius I, and the western half in Rome under Honorius, his brother.','41.01224','28.976018','395','0','0','395-0-0 00:00:00.000000','395-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1104,'Constantinople','October 4?Heraclius arrives by ship from Africa at Constantinople, overthrows East Roman Emperor Phocas and becomes Emperor. His first major act is to change the official language of the East Roman Empire from Latin to Greek (already the language of the vast majority of the population).  Because of this, after AD 610 the East Roman Empire is customarily referred to as the Byzantine Empire (the term Byzantine is a modern term invented by historians in the 18th century; the people of the Empire itself always referred to themselves as ??????? ? in English, Romious).','41.01224','28.976018','610','10','4','610-10-4 00:00:00.000000','610-10-4 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1105,'Constantinople','Forming an alliance with deserters of Tribigild along the Bosphorus, Gothic leader Gainas devastates the outlying areas near Constantinople.','41.01224','28.976018','399','0','0','399-0-0 00:00:00.000000','399-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1106,'Constantinople','January 26 &ndash; Treaty of Karlowitz is concluded.  The Republic of Venice, Poland and Austria sign a peace treaty with the Ottoman Empire.  The Ottoman Turks cede to Austria all their former territories in Transylvania, Slavonia, Croatia and the whole of Hungary except for the Banat of Temesvar.  The Peloponnese and Dalmatia are ceded to Venice.  Large parts of the Ukraine are ceded to Poland.  The treaty marks a significant stage in the decline of the Ottoman Empire that has dominated eastern Europe since the fall of Constantinople in 1453.','41.01224','28.976018','1699','1','26','1699-1-26 00:00:00.000000','1699-1-26 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1107,'Constantinople','The Eurasian Avars, a mounted people who have swept across Russia and southeastern Europe, seize Byzantine forts along the Danube and reach the walls of Constantinople.','41.01224','28.976018','583','0','0','583-0-0 00:00:00.000000','583-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1108,'Constantinople','Belisarius stands trial for corruption in Constantinople, possibly with Procopius acting as urban prefect.','41.01224','28.976018','562','0','0','562-0-0 00:00:00.000000','562-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1109,'Constantinople','The Kutrigurs and Huns under Zabergan invade and raid Byzantine territory, but are driven back near Constantinople by Belisarius.','41.01224','28.976018','559','0','0','559-0-0 00:00:00.000000','559-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1110,'Constantinople','January 1?Anicius Faustus Albinus Basilius is appointed as consul in Constantinople, the last person to hold this office.','41.01224','28.976018','541','1','1','541-1-1 00:00:00.000000','541-1-1 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1111,'Constantinople','Some members of the Blue and Green chariot racing factions in Constantinople are imprisoned for murder, precipitating the Nika riots the next year.','41.01224','28.976018','531','0','0','531-0-0 00:00:00.000000','531-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1112,'Constantinople','Estimation: Ctesiphon, capital of the Sassanid Empire, becomes the largest city of the world, taking the lead from Constantinople, capital of the Byzantine Empire.','41.01224','28.976018','570','0','0','570-0-0 00:00:00.000000','570-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1113,'Constantinople','The Statue of Zeus, one of the Seven Wonders of the Ancient World, is destroyed by fire after being moved to Constantinople.','41.01224','28.976018','462','0','0','462-0-0 00:00:00.000000','462-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1114,'Constantinople','October 29?Valentinian III, Western Emperor, marries Licinia Eudoxia, daughter of his cousin Theodosius II, Eastern Emperor in Constantinople. This unifies the two branches of the House of Theodosius.','41.01224','28.976018','437','0','0','437-0-0 00:00:00.000000','437-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1115,'Constantinople','September 28?Procopius bribes two legions passing by Constantinople, proclaims himself Roman emperor, and takes control of Thrace and Bithynia.','41.01224','28.976018','365','0','0','365-0-0 00:00:00.000000','365-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1116,'Constantinople','The Synod of the Oak deposes and banishes John Chrysostom, bishop of Constantinople, but shortly afterward he is recalled only to be banished again.','41.01224','28.976018','403','0','0','403-0-0 00:00:00.000000','403-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1117,'Constantinople','While taking refuge along the Danube, Gainas and his Goths are attacked by the Huns, who kill him and his army. Gainas'' head is sent as a gift to Constantinople by the Hun chieftain Uldin.','41.01224','28.976018','400','0','0','400-0-0 00:00:00.000000','400-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1118,'Constantinople','An obelisk, taken from Egypt, is erected near the hippodrome in Constantinople.','41.01224','28.976018','394','0','0','394-0-0 00:00:00.000000','394-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1119,'Constantinople','February 27 ? Theodosius I, with co-emperors Gratianus and Valentinian II, declare their wish that all their peoples convert to trinitarian Christianity, in accordance with the patriarchs of Rome and Alexandria, implicitly rejecting the Arianism of the patriarch of Constantinople as heretical.','41.01224','28.976018','380','0','0','380-0-0 00:00:00.000000','380-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1120,'Constantinople','November 24 ? Theodosius I makes his ''''adventus'''', or formal entry, into Constantinople.','41.01224','28.976018','380','0','0','380-0-0 00:00:00.000000','380-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1121,'Constantinople','December 11?The first known Prefect of the City of Constantinople, Honoratus, takes office.','41.01224','28.976018','359','12','11','359-12-11 00:00:00.000000','359-12-11 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1122,'Constantinople','Constantinople, capital of Emperor Constantius II, becomes the largest city of the world, taking the lead from Rome, capital of Emperor Constans.','41.01224','28.976018','340','0','0','340-0-0 00:00:00.000000','340-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1123,'Constantinople','November 7?Athanasius is banished to Trier, on the charge that he prevented the corn fleet from sailing to Constantinople.','41.01224','28.976018','335','11','7','335-11-7 00:00:00.000000','335-11-7 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1124,'Constantinople','The Tetrarchs are probably made in Egypt. After 330 the are moved to Constantinople and in 1204 they are installed at the corner of the facade of the St Mark''s Basilica, Venice (approximate date).','41.01224','28.976018','300','0','0','300-0-0 00:00:00.000000','300-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1125,'Constantinople','August 12 &ndash; With the help of the Genoese, Byzantine co-emperor Andronicus IV Palaeologus invades Constantinople and dethrones his father, John V Palaeologus, as co-emperor. John V Palaeologus is taken prisoner.','41.01224','28.976018','1376','8','12','1376-8-12 00:00:00.000000','1376-8-12 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1126,'Constantinople','Byzantine co-emperor Andronikos IV Palaiologos rebels against his father, John V Palaiologos, for agreeing to let Constantinople become a vassal of the Ottoman Empire. After the rebellion fails, Ottoman Emperor Murad I commands John V Palaiologos to blind his son.','41.01224','28.976018','1373','0','0','1373-0-0 00:00:00.000000','1373-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1127,'Constantinople','The Ottomans capture Philippopolis and Adrianopole (now the city of Edirne) from the Byzantine Empire, reducing it to the city of Constantinople.','41.01224','28.976018','1362','0','0','1362-0-0 00:00:00.000000','1362-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1128,'Constantinople','March 30 &ndash; The Sicilian rebellion known as the Sicilian Vespers begins against the rule of Angevin King Charles I of Sicily; over the next 6 weeks, thousands of French are killed.  The rebellion forces Charles to abandon the Ninth Crusade while still en route to the target city of Constantinople, and allows King Peter III of Aragon to take over rule of the island from Charles (which in turn leads to Peter''s excommunication by Pope Martin IV).','41.01224','28.976018','1282','0','0','1282-0-0 00:00:00.000000','1282-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1129,'Constantinople','7 August?The Byzantines defeat the Avars and Slavs, who were besieging Constantinople for the first time.','41.01224','28.976018','626','0','0','626-0-0 00:00:00.000000','626-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1130,'Constantinople','July 25 &ndash; The city of Constantinople is recaptured by Nicaean forces under the command of Alexios Strategopoulos, thus re-establishing the Byzantine Empire.','41.01224','28.976018','1261','0','0','1261-0-0 00:00:00.000000','1261-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1131,'Constantinople','September &ndash; Battle of Pelagonia: The Empire of Nicaea defeats the Principality of Achaea, ensuring the eventual reconquest of Constantinople in 1261.','41.01224','28.976018','1259','9','0','1259-9-0 00:00:00.000000','1259-9-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1132,'Constantinople','May &ndash; William of Rubruck from Constantinople returns to Cyprus from his missionary journey to convert the Tatars of central and eastern Asia, his efforts having been unsuccessful.','41.01224','28.976018','1255','5','0','1255-5-0 00:00:00.000000','1255-5-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1133,'Constantinople','May &ndash; King Louis IX of France dispatches William of Rubruck from Constantinople on a missionary journey to convert the Tatars of central and eastern Asia. Later that year, William records the first meeting between European Christians and Buddhists.','41.01224','28.976018','1253','5','0','1253-5-0 00:00:00.000000','1253-5-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1134,'Constantinople','Baldwin II becomes emperor of the Latin Empire in Constantinople, with John of Brienne as regent.','41.01224','28.976018','1228','0','0','1228-0-0 00:00:00.000000','1228-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1135,'Constantinople','April 9 &ndash; Peter of Courtenay is crowned emperor of the Latin Empire of Constantinople at Rome, by Pope Honorius III.','41.01224','28.976018','1217','0','0','1217-0-0 00:00:00.000000','1217-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1136,'Constantinople','April 13 &ndash; Fourth Crusade: The Crusaders take Constantinople by storm, and pillage the city for 3 days.','41.01224','28.976018','1204','4','13','1204-4-13 00:00:00.000000','1204-4-13 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1137,'Constantinople','Estimation: Fes in the Almohad Empire becomes the largest city of the world, taking the lead from Constantinople, capital of the Byzantine Empire.','41.01224','28.976018','1170','0','0','1170-0-0 00:00:00.000000','1170-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1138,'Constantinople','Estimation: Merv in the Seljuk Empire becomes the largest city of the world, taking the lead from Constantinople, capital of the Byzantine Empire.','41.01224','28.976018','1145','0','0','1145-0-0 00:00:00.000000','1145-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1139,'Constantinople','April 29 ? Battle of Levounion: The Pechenegs besiege Constantinople, but are defeated so decisively by Emperor Alexius I that they fade into oblivion.','41.01224','28.976018','1091','4','29','1091-4-29 00:00:00.000000','1091-4-29 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1140,'Constantinople','July 16?Cardinal Humbertus, a representative of Pope Leo IX, and Michael Cerularius, Patriarch of Constantinople, decree each other''s excommunication. Most historians look to this act as the final step in the initiation of the Great Schism between the Roman Catholic and Orthodox Christian Churches.  In 1965, those excommunications are rescinded by Pope Paul VI and Patriarch Athenagoras when they meet in the Second Vatican Council.  However, to this day each church claims to be the One Holy Catholic and Apostolic Church and each denies the other''s right to that name. (See East-West Schism)','41.01224','28.976018','1054','7','16','1054-7-16 00:00:00.000000','1054-7-16 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1141,'Constantinople','Nikephoros II Phokas is proclaimed emperor by his troops in Caesarea on 2 July. After street fighting in Constantinople between his supporters and the men of the chief minister Joseph Bringas, he enters the city and is crowned emperor on 16 August. In September, he marries the empress Theophano, widow of Romanos II.','41.01224','28.976018','963','0','0','963-0-0 00:00:00.000000','963-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1142,'Constantinople','Page with Joshua Leading the Israelites, from the Joshua Roll, is made in Constantinople. It is now kept at Biblioteca Apostolica Vaticana, Rome (approximate date).','41.01224','28.976018','950','0','0','950-0-0 00:00:00.000000','950-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1143,'Constantinople','The Glagolitic alphabet, devised by Cyril and Methodius, missionaries from Constantinople, is  adopted in the Bulgarian Empire.','41.01224','28.976018','886','0','0','886-0-0 00:00:00.000000','886-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1144,'Constantinople','March 13?The bones of Saint Nicephorus are interred in the Church of the Apostles, Constantinople.','41.01224','28.976018','874','3','13','874-3-13 00:00:00.000000','874-3-13 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1145,'Constantinople','A council is organized in Constantinople, but is disturbed by soldiers.','41.01224','28.976018','786','0','0','786-0-0 00:00:00.000000','786-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1146,'Constantinople','According to the historian Theophanes, the Black Sea melts and ice bergs float past Constantinople.','41.01224','28.976018','764','0','0','764-0-0 00:00:00.000000','764-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1147,'Constantinople','October 26?An earthquake strikes Constantinople and the surrounding countryside, causing destruction to the city''s land walls and buildings, and many deaths.','41.01224','28.976018','740','10','26','740-10-26 00:00:00.000000','740-10-26 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1148,'Constantinople','May 11?Constantine I refounds Byzantium, renames it ''''New Rome'''', and moves the capital of the Roman Empire there from Rome. It is later known as Constantinople.','41.01224','28.976018','330','5','11','330-5-11 00:00:00.000000','330-5-11 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1149,'Constantinople','Emperor Leo III and Khan Tervel defeat Arab forces besieging Constantinople, stopping a large Arab incursion towards Europe.','41.01224','28.976018','718','0','0','718-0-0 00:00:00.000000','718-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1150,'Constantinople','Bishop Eustorgius I brings relics of the Three Magi from Constantinople to Milan, according to a 12th century legend.','41.01224','28.976018','344','0','0','344-0-0 00:00:00.000000','344-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(1151,'Corfu','A dispute arises between Epidamnus'' oligarchs and democratic forces in the Greek colony. Most of the colony''s inhabitants originate from Corinth or Corcyra (Corfu).  Epidamnus'' oligarchs are exiled and then appeal to Corcyra for help, while the democrats enlist the support of Corinth. Corcyra is then attacked by Corinth as the dispute heats up.','39.666664','19.749997','-435','0','0','-435-0-0 00:00:00.000000','-435-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
