INSERT INTO "histories-all" VALUES(1721,'Fujian','Just 2 years after the Ming Dynasty court of China allowed landowners paying the grain tax to pay their tax in silver instead, the Ming court now decides to close all silver mines and to ban all private silver mining in Zhejiang and Fujian provinces. This is a concerted effort to halt the increase of silver circulating into the market. Illegally mining silver is now an offense punishable by death; although illegal mining became a dangerous affair, the high demand for illegal mining also made it very lucrative, and so many chose to defy the government and continued to mine silver.','26.5499978','117.8499966','1438','0','0','1438-0-0 00:00:00.000000','1438-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
