INSERT INTO "histories-all" VALUES(2146,'Iran','Through the peace treaty of Apamea (in Phrygia), the Romans force the Seleucid king, Antiochus III, to surrender all his Greek and Anatolian possessions as far east as the Taurus Mountains, to pay 15,000 talents over a period of 12 years and to surrender to Rome the former Carthaginian general Hannibal, his elephants and his fleet, and furnish hostages, including the king''s eldest son, Demetrius. Rome is now the master of the eastern Mediterranean while Antiochus III''s empire is reduced to Syria, Mesopotamia, and western Iran.','32','53','-188','0','0','-188-0-0 00:00:00.000000','-188-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
