INSERT INTO "histories-all" VALUES(2148,'Iran','The Seleucid king Antiochus IV Epiphanes dies while on a campaign in Tabae (or Gabae, now Isfahan) in Persia. He is succeeded by his son Antiochus V Eupator who is only nine years old. The regent for the boy is the late king''s chancellor, Lysias, who has been left in charge of Syria when Antiochus IV departed for his campaign in Persia. Lysias is, however, seriously challenged by other Syrian generals and finds himself with a precarious hold on power. To make matters worse for him, the Roman Senate is holding Demetrius, the son of the former king Seleucus IV and, therefore, the rightful heir to the Seleucid throne, as a hostage. By threatening to release him, the Senate is able to influence events in the Seleucid kingdom.','32','53','-164','0','0','-164-0-0 00:00:00.000000','-164-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
