INSERT INTO "histories-all" VALUES(2173,'Iraq','January &ndash; One of the largest volcanic eruptions of the Holocene epoch occurs, possibly from a tropical location such as El Chich�n, Mexico or Quilotoa, Ecuador.Geophysical Research Letters'''', 321, XXXX, doi:10.1029/2006JAXYZW, Mar 2006. (available [http://www.ldeo.columbia.edu/~julieneg/docs/1258_enso_grl.pdf online], pdf file)<  Observed effects of the eruption include the following anecdotal accounts: dry fog in France; lunar eclipses in England; severe winter in Europe; a harsh spring in Northern Iceland; famine in England, Western Germany, France, and Northern Italy; and pestilence in London, parts of France, Austria, Iraq, Syria, and South-East Turkey.','33','44','1258','1','0','1258-1-0 00:00:00.000000','1258-1-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
