INSERT INTO "histories-all" VALUES(2495,'Italy','A fatal disease of cattle, probably rinderpest, spreads through the Italian provinces of Padua, Udine, Treviso, and Vicenza, introduced most likely from Dalmatia or Hungary. Great numbers of cattle die in Italy, as they had in previous years (1559, 1562, 1566, 1590, 1598) in other European regions when harvest failure also drives people to the brink of starvation (for example, 1595?1597 in Germany). The consumption of beef and veal is prohibited, and Pope Paul V issues an edict prohibiting the slaughter of draught oxen that were suitable for plowing. Calves are also not slaughtered for a some time afterwards, so that Italy''s cattle herds can be replenished.','41.8999964','12.4833314','1616','0','0','1616-0-0 00:00:00.000000','1616-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
