INSERT INTO "histories-all" VALUES(2576,'Judea','Since the reign of the Seleucid king, Antiochus III, the Jewish inhabitants of Judea enjoy extensive autonomy under their high priest. However, they are divided into two parties, the orthodox Hasideans (Pious Ones) and a reform party that favours Hellenism. Antiochus IV supports the reform party because of the financial support they provide him with. In return for a considerable payment, he has permitted the high priest, Jason, to build a gymnasium in Jerusalem and to introduce the Greek mode of educating young people. Jason''s time as high priest is brought to an abrupt end when he sends Menelaus, the brother of Simon the Benjaminite, to deliver money to Antiochus IV. Menelaus takes this opportunity to outbid Jason for the priesthood, resulting in Antiochus IV confirming Menelaus as the High Priest.','31.692663896','35.303832118','-172','0','0','-172-0-0 00:00:00.000000','-172-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(2577,'Judea','The usurped high priest of Judea, Jason, does not abandon his claims to being the high priest which he has lost to Menelaus two years earlier. While Antiochus IV is waging war against Egypt, he succeeds in making himself master of Jerusalem once more and forces Menelaus to seek refuge in the citadel.','31.692663896','35.303832118','-170','0','0','-170-0-0 00:00:00.000000','-170-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
