INSERT INTO "histories-all" VALUES(3378,'Pataliputra','According to the Therav?da commentaries and chronicles, the Third Buddhist Council is convened by the Mauryan king Ashoka at Pataliputra (modern Patna), under the leadership of the monk Moggaliputta Tissa. Its objective is to purify the Buddhist movement, particularly from opportunistic factions which are being attracted by the royal patronage.','25.6125','85.1283333333','-250','0','0','-250-0-0 00:00:00.000000','-250-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
