INSERT INTO "histories-all" VALUES(3381,'Peloponnese','Athenian forces block the routes back to the Peloponnese, so the Spartans decide to remain in Boeotia and await the Athenian attack. The Athenians and their allies, with 14,000 men under the command of Myronides, meet the Spartans at Battle of Tanagra. The Spartans win the battle, but they lose many men and so are unable to follow up on their victory.','37.343165294','22.351331928','-457','0','0','-457-0-0 00:00:00.000000','-457-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
