INSERT INTO "histories-all" VALUES(3386,'Peloponnese','The leader of the Achaean League, Philopoemen, enters northern Laconia with his army and a group of Spartan exiles. His army demolishes the wall that the former tyrant of Sparta, Nabis, has built around Sparta. Philopoemen then restores Spartan citizenship to the exiles and abolishes Spartan law, introducing Achaean law in its place. Sparta''s role as a major power in Greece ends, while the Achaean League becomes the dominant power throughout the Peloponnese.','37.343165294','22.351331928','-188','0','0','-188-0-0 00:00:00.000000','-188-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
