INSERT INTO "histories-all" VALUES(3630,'Rhine','Emperor Alexander Severus and his mother Julia Mamaea move to Moguntiacum (modern Mainz), the capital of Germania Superior. His generals planned an military offensive and built a bridge across the Rhine. Alexander prefers to negotiates for peace by buying off the Alemanni. This policy outrage the Roman legions and he lost his trust by the troops.','51.975329432','4.08916631','234','0','0','234-0-0 00:00:00.000000','234-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
