INSERT INTO "histories-all" VALUES(3649,'Rhodes','Antigonus I Monophthalmus sends his son Demetrius to conquer Rhodes, which has refused him armed support against Ptolemy. He shows ingenuity in devising new siege engines in his unsuccessful attempt to reduce the city. Among his creations are a battering ram 60 metres long and requiring 1,000 men to operate it and a wheeled siege tower named Helepolis (or Taker of Cities) which stands 40 metres tall and 20 metres wide and weighs 180 tons. This siege of Rhodes earns Demetrius the title Poliorcetes (the City Besieger).','36.166666','28','-305','0','0','-305-0-0 00:00:00.000000','-305-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3650,'Rhodes','The siege of Rhodes ends after a year as Demetrius Poliorcetes meets with obstinate resistance from the citizens of Rhodes who are supported by Ptolemy (thereby earning Ptolemy the title of Soter (Saviour)). Antigonus then concludes a peace treaty and an alliance with the island state, guaranteeing it autonomy and neutrality in his conflicts with Ptolemy.','36.166666','28','-304','0','0','-304-0-0 00:00:00.000000','-304-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3651,'Rhodes','The Athenian general, Thrasybulus, leads a force of triremes to levy tribute from cities around the Aegean and support Rhodes, where a democratic government is struggling against Sparta. On this campaign, Thrasybulus captures Byzantium, imposes a duty on ships passing through the Hellespont, and collects tribute from many of the islands of the Aegean.','36.166666','28','-389','0','0','-389-0-0 00:00:00.000000','-389-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
