INSERT INTO "histories-all" VALUES(3660,'Rhodes','The Battle of Gythium is fought between Sparta and a coalition of Rome, Rhodes, the Achaean League and Pergamum. As the port of Gythium is an important Spartan base, the allies decide to capture it before they advance inland to Sparta. The Romans and the Acheans are joined outside the city by the Pergamese and Rhodian fleets. The Spartans hold out, however the pro-consul Titus Quinctius Flamininus arrives with 4,000 extra men. Facing too great an army, the Spartans decide to surrender the city on the condition that the garrison can leave unharmed. As a result, Nabis, the tyrant of Sparta, is forced to abandon the surrounding land and withdraw to the city of Sparta. Later that year, Sparta capitulates to the allies.','36.166666','28','-195','0','0','-195-0-0 00:00:00.000000','-195-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
