INSERT INTO "histories-all" VALUES(3769,'Sicyon','Siege of Perusia: After a last attempt to break the siege, which failed; Lucius Antonius surrenders to Octavian. His life is spared, but the citizens are executed or sold in slavery. Fulvia fled with her children and is exiled to Sicyon, where she died of a sudden illness.','37.984104','22.711145','-40','0','0','-40-0-0 00:00:00.000000','-40-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3770,'Sicyon','Abantidas, the tyrant of Sicyon, is murdered by his enemies and is succeeded by his father, Paseas.','37.984104','22.711145','-252','0','0','-252-0-0 00:00:00.000000','-252-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3771,'Sicyon','Paseas, the tyrant of the Greek city-state of Sicyon, is assassinated by Nicocles, with the acquiescence of the Macedonian king Antigonus II. Nicocles reigns as tyrant of Sicyon for only four months, during which period he drives into exile eighty of the city''s citizens. Then the citadel of Sicyon is surprised in the night by a party of Sicyonian exiles, headed by a young nobleman, Aratus. The palace of the tyrant is set on fire, but Nicocles escapes from the city through a subterranean passage.','37.984104','22.711145','-251','0','0','-251-0-0 00:00:00.000000','-251-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3772,'Sicyon','The Theban general, Epaminondas, again invades the Peloponnesus, but this time achieves little beyond winning Sicyon over to an alliance with Thebes. When he returns to Thebes, he is again put on trial, and again acquitted.','37.984104','22.711145','-367','0','0','-367-0-0 00:00:00.000000','-367-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3773,'Sicyon','Pericles leads a naval expedition in the Corinthian Gulf, in which Athens defeats Achaea. He then attacks Sicyon and Acarnania, after which he unsuccessfully tries to take Oeniadea on the Corinthian Gulf, before returning to Athens.','37.984104','22.711145','-454','0','0','-454-0-0 00:00:00.000000','-454-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3774,'Sicyon','Demosthenes and Hippocrates attempt to capture Megara, but they are defeated by the Spartans under their general Brasidas. Demosthenes then marches to Naupactus to assist in a democratic revolution, and to gather troops for an invasion of Boeotia. However, Demosthenes and Hippocrates are unable to coordinate their attacks and Hippocrates is defeated at the Battle of Delium by Pagondas of Thebes. During the battle, Socrates is said to have saved the life of Alcibiades. Demosthenes attacks Sicyon and is defeated as well.','37.984104','22.711145','-424','0','0','-424-0-0 00:00:00.000000','-424-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
