INSERT INTO "histories-all" VALUES(3790,'Sisak','Pannonia is attacked by Octavian Caesar; who conquered and sacked the stronghold Siscia (Sisak) of the Segestani, which is taken after a 30-day siege. The country is however, definitely subdued until 9 BC.','45.4666648','16.3833318','-35','0','0','-35-0-0 00:00:00.000000','-35-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
