INSERT INTO "histories-all" VALUES(3797,'So�mar','August 27 &ndash; Advice and citizenry of Hildesheim (Germany) profess themselves to the Lutheran teachings. As a pledge owner, the city Hildesheim provides for the execution of the Reformation in the city and office of Peine. The priests from the localities of Clauen, Hohenhameln, Sossmar, Schmedenstedt, Lengede and Rosenthal {{dn}} resume their offices in the sense of the Reformation.','52.238499046','10.055333112','1542','8','27','1542-8-27 00:00:00.000000','1542-8-27 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3798,'Sparta','After spending the winter in organizing a cavalry force, Agesilaus II, the King of Sparta, makes a successful incursion into Lydia in the spring.','37.07583303','22.42083165','-395','0','0','-395-0-0 00:00:00.000000','-395-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3799,'Sparta','The allies, Athens, Thebes, Corinth and Argos, gather a large army at Corinth. A sizable army is sent out from Sparta to challenge this force. The two sides meet on the dry bed of the Nemea River, in Corinthian territory. In the resultant Battle of Nemea, the Spartans win a major victory over the allies.','37.07583303','22.42083165','-394','0','0','-394-0-0 00:00:00.000000','-394-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3800,'Sparta','Xenophon''s Ten Thousand make their way back to Greece, with most of the men enlisting with the Spartans. Xenophon''s successful march through the Persian Empire encourages Sparta to turn on the Persians and begin wars against the Persians in Asia Minor.','37.07583303','22.42083165','-400','0','0','-400-0-0 00:00:00.000000','-400-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3801,'Sparta','Athens, under Athenian general Tolmides, sends 100 ships around the Peloponnesus and they set fire to the Spartan naval base at Gythion. As a result, Athens gains the agreement of the Achaean cities to join the Delian League. Athenian forces then go on to attack the Spartan allies on the Corinthian Gulf. Athens is now able to confine Sparta to the southern Peloponnesus.','37.07583303','22.42083165','-455','0','0','-455-0-0 00:00:00.000000','-455-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3802,'Sparta','Athens, in preparing for participation in the Spartan-Theban struggle, reorganises its finances and its taxation, inaugurating a system whereby the richer citizens are responsible for the collection of taxes from the less rich.','37.07583303','22.42083165','-377','0','0','-377-0-0 00:00:00.000000','-377-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3803,'Sparta','The Greek city of Aegina, fearing the loss of trade, submits to Persia. The Spartan king, Cleomenes I tries to punish Aegina for its submission to the Persians, but the other Spartan king, Demaratus, thwarts him.','37.07583303','22.42083165','-491','0','0','-491-0-0 00:00:00.000000','-491-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3804,'Sparta','The Spartan King Cleomenes III captures Mantineia and defeats the Achaean League under Aratus of Sicyon at Hecatombaeum, near Dyme in north-eastern Elis.','37.07583303','22.42083165','-226','0','0','-226-0-0 00:00:00.000000','-226-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3805,'Sparta','The Corinthian War begins, with Athens, Thebes, Corinth and Argos (with the backing of Persia) against Sparta. The Spartans prepare to send out an army against this new alliance, and order Agesilaus to return to Greece. Agesilaus sets out for Sparta with his troops, crossing the Hellespont and marching west through Thrace.','37.07583303','22.42083165','-395','0','0','-395-0-0 00:00:00.000000','-395-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3806,'Sparta','While Pausanias is occupying Byzantium, his arrogance and his adoption of Persian clothing and manners offends the allies and raises suspicions of disloyalty. Pausanias is recalled to Sparta, where he is tried and acquitted of the charge of treason, but he is not restored to his command.','37.07583303','22.42083165','-478','0','0','-478-0-0 00:00:00.000000','-478-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3807,'Sparta','King Agis II of Sparta escapes having his house razed and being fined 100,000 drachmae for his failure to press his advantage by promising more successful outcomes in the future.','37.07583303','22.42083165','-418','0','0','-418-0-0 00:00:00.000000','-418-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3808,'Sparta','Hostilities among the Greek states come to a formal end with the agreement to the Five Years'' Truce. Kimon negotiates the five years'' truce with Sparta, in which Athens agrees to abandon its alliance with Argos, while Sparta promises to give up its alliance with Thebes. During the same year Argos signs the first Thirty-Years Peace with Sparta.','37.07583303','22.42083165','-451','0','0','-451-0-0 00:00:00.000000','-451-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3809,'Sparta','Darius I sends envoys to all Greek cities, demanding earth and water for vassalage which Athens and Sparta refuse however.','37.07583303','22.42083165','-491','0','0','-491-0-0 00:00:00.000000','-491-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3810,'Sparta','Suspected of plotting to seize power in Sparta by instigating a helot uprising, Pausanias takes refuge in the Temple of Athena of the Brazen House to escape arrest. The sanctuary is respected, but the Spartans wall in the sanctuary and starve Pausanias to death.','37.07583303','22.42083165','-470','0','0','-470-0-0 00:00:00.000000','-470-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3811,'Sparta','King Agesipolis I leads a Spartan army against Argos. Since no Argive army challenges him, he plunders the countryside for a time, and then, after receiving several unfavorable omens, returns to Sparta.','37.07583303','22.42083165','-388','0','0','-388-0-0 00:00:00.000000','-388-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3812,'Sparta','Although the Egyptian fleet blockades the Saronic Gulf, the Macedonian King Antigonus II defeats the Spartans and kills the King of Sparta, Areus I near Corinth, after which he besieges Athens.','37.07583303','22.42083165','-265','0','0','-265-0-0 00:00:00.000000','-265-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3813,'Sparta','Concerned about the revival of Athenian imperialist ambitions, the Persian King Artaxerxes II and King Agesilaus II of Sparta enter into an alliance. Sparta also seeks and gains the support of Dionysius I of Syracuse.','37.07583303','22.42083165','-388','0','0','-388-0-0 00:00:00.000000','-388-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3814,'Sparta','Called on by the Ionians to assist them against the Persian King Artaxerxes II, King Agesilaus II of Sparta launches an ambitious campaign in Asia Minor.','37.07583303','22.42083165','-397','0','0','-397-0-0 00:00:00.000000','-397-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3815,'Sparta','The Athenians and Spartans, worn down by several years of war and the devastation of their lands, make peace with Antigonus II of Macedonia who thus retains his hold on Greece.','37.07583303','22.42083165','-263','0','0','-263-0-0 00:00:00.000000','-263-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3816,'Sparta','With the support of the Persian King Artaxerxes II, King Agesilaus II of Sparta concludes the King''s Peace (or the Peace of Antalcidas, after the Spartan envoy and commander) with Greek allied forces in a manner favourable to Sparta. Under the Peace, all the Asiatic mainland and Cyprus remain under Persian control, Lemnos, Imbros, and Scyros remain Athenian dependencies, and all the other Greek states are to receive autonomy. By the King''s Peace, the Persians become key players in Greek politics.','37.07583303','22.42083165','-387','0','0','-387-0-0 00:00:00.000000','-387-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3817,'Sparta','Antalcidas, commander of the Spartan navy, actively assists Persia against Athens. After escaping from the Athenian blockade at Abydos, he attacks and defeats a small Athenian force, then joins his fleet with a supporting fleet sent from Syracuse. With this force, which is soon further augmented with ships supplied by the Persian satraps of the region, he sails to the Hellespont, where he is in a position to cut off the trade routes that bring grain to Athens.','37.07583303','22.42083165','-387','0','0','-387-0-0 00:00:00.000000','-387-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3818,'Sparta','Samos, an autonomous member of the Delian League and one of Athens'' principal allies with a substantial fleet of its own, quarrels with Miletus and appeals to Athens for assistance. Pericles decides in favour of Miletus, so Samos revolts. Pericles then sails to Samos with a fleet to overthrow its oligarchic government and install a democratic one. Sparta threatens to interfere. However, at a congress of the Peloponnesian League, its members vote not to intervene on behalf of Samos against Athens.','37.07583303','22.42083165','-440','0','0','-440-0-0 00:00:00.000000','-440-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3819,'Sparta','Freed from Spartan attacks by the King''s Peace of the previous year, Persia turns to quieting Cyprus and Egypt. Owing to the skill of King Evagoras of Cyprus and of Egypt''s Greek mercenary general Chabrias, these wars drag on for the rest of the decade.','37.07583303','22.42083165','-386','0','0','-386-0-0 00:00:00.000000','-386-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3820,'Sparta','The Carthaginians, angered by Regulus'' demands, hire Xanthippus, a Spartan mercenary, to reorganize the army. The revitalised Carthaginian army, led by Xanthippus, decisively defeat the Romans in the Battle of Tunis and capture their commander Marcus Atilius Regulus. A Roman fleet, sent to rescue Regulus and his troops, is wrecked in a storm off Sicily.','37.07583303','22.42083165','-255','0','0','-255-0-0 00:00:00.000000','-255-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3821,'Sparta','King Amyntas III of Macedon, forms a temporary alliance with the Chalcidian League. Sparta, whose policy is to keep Greeks disunited, sends an expedition northwards to disrupt the Chalcidian League, a confederation of cities of the Chalcidice peninsula, east of Macedonia.','37.07583303','22.42083165','-383','0','0','-383-0-0 00:00:00.000000','-383-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3822,'Sparta','The Theban general and statesman, Pelopidas flees to Athens and takes the lead in attempts to liberate Thebes from Spartan control.','37.07583303','22.42083165','-382','0','0','-382-0-0 00:00:00.000000','-382-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3823,'Sparta','A Spartan attempt to seize Piraeus brings Athens closer to Thebes. The Athenian mercenary, Chabrias, defeats the Spartans in the battle. In fighting the battle, Chabrias invents a new defensive technique; he orders each soldier to receive a charge kneeling on his left knee, with his shield resting on the ground and spear pointed at the enemy.','37.07583303','22.42083165','-378','0','0','-378-0-0 00:00:00.000000','-378-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3824,'Sparta','The King of Sparta, Agesilaus II, dies at Cyrene, Cyrenaica, on his way home to Greece from Egypt. He is succeeded by his son Archidamus III as Eurypontid king of Sparta.','37.07583303','22.42083165','-360','0','0','-360-0-0 00:00:00.000000','-360-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3825,'Sparta','Under the leadership of Pericles, Athens introduces a series of measures (the Megarian decree) imposing an economic embargo on Megara for violations of land sacred to Demeter. According to the provisions of the decree, Megarian merchants are to be excluded from the market of Athens and the ports in its empire. This ban strangles the Megarian economy and strains the fragile peace between Athens and Sparta, which is allied with Megara.','37.07583303','22.42083165','-434','0','0','-434-0-0 00:00:00.000000','-434-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3826,'Sparta','Pericles proposes a Congress Decree allowing the use of 9,000 talents to finance the massive rebuilding program of Athenian temples. This leads to a meeting (Congress) of all Greek states in order to consider the question of rebuilding the temples destroyed by the Persians. The Congress fails because of Sparta''s opposition.','37.07583303','22.42083165','-449','0','0','-449-0-0 00:00:00.000000','-449-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3827,'Sparta','Athens tries to retire from the Theban-Spartan war and makes peace with Sparta. However, the peace is quickly broken.','37.07583303','22.42083165','-374','0','0','-374-0-0 00:00:00.000000','-374-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3828,'Sparta','Agis IV succeeds his father, Eudamidas II, as King of Sparta.','37.07583303','22.42083165','-244','0','0','-244-0-0 00:00:00.000000','-244-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3829,'Sparta','Drawing upon the tradition of the Spartan lawgiver, Lycurgus, the young Eurypontid king of Sparta, Agis IV, seeks to reform a system that distributes the land and wealth unequally and burden the poor with debt. He proposes the cancellation of debts and the division of the Spartan homeland into separate lots for each of its citizens. Full citizenship is to be extended to many perioeci (voteless freemen) and foreigners. In addition to pursuing these reforms, Agis seeks the restoration of the Lycurgan system of military training. Agis is supported by his wealthy mother and grandmother (who surrender their property), by his uncle Agesilaus, and by Lysander, who is an ephor (magistrate with the duty of limiting the power of the king).','37.07583303','22.42083165','-243','0','0','-243-0-0 00:00:00.000000','-243-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3830,'Sparta','The Eurypontid King of Sparta, Agis IV, is called away from Sparta when Aratus of Sicyon, temporarily Sparta''s ally, requests Agis'' aid in his war against the Aetolians. Upon his return, Agis finds that his supporters are discontented with the rule of his uncle, Agesilaus, and are disillusioned by the delay in implementing the Agis IV''s reforms. As a result, the Agiad king of Sparta, Leonidas II, gains power, supported by mercenaries. Rather than engage in a war with Leonidas, Agis takes sanctuary in a temple, but is enticed out, summarily tried and then executed, along with his mother and grandmother.','37.07583303','22.42083165','-241','0','0','-241-0-0 00:00:00.000000','-241-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3831,'Sparta','Aristagoras seeks help with the revolt against the Persians from Cleomenes I, the King of Sparta, but the Spartans are unwilling to respond.','37.07583303','22.42083165','-499','0','0','-499-0-0 00:00:00.000000','-499-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3832,'Sparta','Aratus of Sicyon counters Aetolian aggression by obtaining the assistance of the Hellenic League now under the leadership of Philip V of Macedonia. In the resulting Social War, the Hellenic League of Greek states is assembled in Corinth at Philip V''s instigation. He then leads the Hellenic League in battles against Aetolia, Sparta and Elis.','37.07583303','22.42083165','-220','0','0','-220-0-0 00:00:00.000000','-220-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3833,'Sparta','In a search for a balance of power against the now powerful Thebes, Athens responds to an appeal for help from Sparta and allies itself with its traditional enemy.','37.07583303','22.42083165','-369','0','0','-369-0-0 00:00:00.000000','-369-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3834,'Sparta','The ephor, Lysander, claims to have seen a sign from the gods against King Leonidas II of Sparta so Leonidas flees to avoid his trial. In his absence, Leonidas is deposed from the throne and replaced by his son-in-law, Cleomenes III.','37.07583303','22.42083165','-235','0','0','-235-0-0 00:00:00.000000','-235-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3835,'Sparta','The citizens of Tarentum seek the help of the Spartan general, Cleonymus. He is able to pacify the Lucanians with the agreement of the Romans.','37.07583303','22.42083165','-303','0','0','-303-0-0 00:00:00.000000','-303-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3836,'Sparta','Theban leader, Epaminondas, returns to the Peloponnesus for a third time, seeking to secure the allegiance of the states of Achaea. Although no army dares to challenge him in the field, the democratic governments he establishes there are short-lived, as pro-Spartan aristocrats soon return to the cities, reestablish the oligarchies, and bind their cities ever more closely to Sparta.','37.07583303','22.42083165','-366','0','0','-366-0-0 00:00:00.000000','-366-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3837,'Sparta','After suffering a defeat in which the Athenian commander Lamachus is killed, Demosthenes suggests that they immediately give up the siege of Syracuse and return to Athens, where they are needed to defend against a Spartan invasion of Attica. Nicias refuses, but the Syracusans and Spartans under Hermocrates are able to trap the Athenians in the harbour and the Athenians sustain heavy losses in the Battle of Syracuse. Demosthenes is ambushed by the Syracusans and is forced to surrender. Nicias is soon captured as well, and both are executed, with most of the surviving Athenian soldiers sent to work in the Sicilian quarries.','37.07583303','22.42083165','-413','0','0','-413-0-0 00:00:00.000000','-413-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3838,'Sparta','Archidamus V, brother of the murdered Spartan King Agis IV, is called back to Sparta by the Agiad King Cleomenes III, who has no counterpart on the throne by then. However, Archidamus V is assassinated shortly after returning.','37.07583303','22.42083165','-228','0','0','-228-0-0 00:00:00.000000','-228-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3839,'Sparta','The Spartan King Cleomenes III imposes reforms on his kingdom which include the cancelling of debts, providing land for 4,000 citizens, and restoring the training of youth in the martial arts. The Ephorate, five elected magistrates who, with the King, form the main executive body of the state, is abolished (four of the five ephors being executed); the powers of the Gerousia, the oligarchic council of elders, is curtailed; and the patronomoi (the board of six elders) is introduced. Cleomenes'' changes are designed to make the monarchy supreme and re-create a society of aristocrats, while neglecting Sparta''s helots (serfs) and perioikoi (free but non-citizen inhabitants). Eighty opponents of the reforms are exiled, while his brother Eucleidas is installed as co-ruler in the place of the murdered Archidamus V.','37.07583303','22.42083165','-227','0','0','-227-0-0 00:00:00.000000','-227-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3840,'Sparta','The army of Sparta loots Attica for a second time, but Pericles is not daunted and refuses to revise his initial strategy. Unwilling to engage the Spartan army in battle, he again leads a naval expedition to plunder the coasts of the Peloponnesus, this time taking 100 Athenian ships with him.','37.07583303','22.42083165','-430','0','0','-430-0-0 00:00:00.000000','-430-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3841,'Sparta','After the Spartan King Cleomenes III takes Pellene, Phlius and Argos, Aratus of Sicyon is forced to call upon King Antigonus III of Macedonia for assistance. Antigonus III''s forces fail to pierce Cleomenes'' lines near Corinth, but a revolt against Cleomenes at Argos put the Spartans on the defensive.','37.07583303','22.42083165','-224','0','0','-224-0-0 00:00:00.000000','-224-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3842,'Sparta','Kimon seeks the support of Athens'' citizens to providing help to Sparta. Although Ephialtes maintains that Sparta is Athens'' rival for power and should be left to fend for itself, Kimon''s view prevails. Kimon then leads 4,000 hoplites to Mount Ithome.','37.07583303','22.42083165','-462','0','0','-462-0-0 00:00:00.000000','-462-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3843,'Sparta','The Egyptian Pharaoh Teos (or Tachos) succeeds his father Nectanebo I to the throne. Planning a great attack on Persia, he invites Sparta to help him.','37.07583303','22.42083165','-363','0','0','-363-0-0 00:00:00.000000','-363-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3844,'Sparta','Thrasybulus leads the democratic resistance to the new oligarchic government, known as the Thirty Tyrants, that the victorious Spartans have imposed on Athens. He commands a small force of exiles that invades Attica and, in successive battles, defeats first a Spartan garrison and then the forces of the oligarchic government (which includes the Spartan general, Lysander) in the Battle of Munychia. The leader of the Thirty Tyrants, Critias, is killed in the battle.','37.07583303','22.42083165','-403','0','0','-403-0-0 00:00:00.000000','-403-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3845,'Sparta','The outbreak of civil war in the Arcadian league leads to Mantinea fighting alongside Sparta and Athens, while Tegea and others members of the league side with Thebes. The Theban general, Epaminondas, heads the large allied army in the Peloponnesus. He is met by Sparta (led by Spartan general Archidamus III), Athens, and their allies in the Battle of Mantinea. In the battle, Epaminondas is victorious, but is killed. His dying command to make peace with the enemy is followed by all sides and a general peace is established in Greece. The period of Theban domination of Greece comes to an end.','37.07583303','22.42083165','-362','0','0','-362-0-0 00:00:00.000000','-362-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3846,'Sparta','Cleomenes III of Sparta is defeated in the Battle of Sellasia (north of Sparta) by Antigonus III and his allies, the Achaean League and the Illyrians (under the command of Demetrius of Pharos), and flees to Egypt under the protection of King Ptolemy III. Antigonus III''s forces occupy Sparta, which is the first time this city has ever been occupied.','37.07583303','22.42083165','-222','0','0','-222-0-0 00:00:00.000000','-222-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3847,'Sparta','King Cleomenes III of Sparta, who is in exile in Egypt, is imprisoned by Ptolemy IV on a charge of conspiracy.','37.07583303','22.42083165','-221','0','0','-221-0-0 00:00:00.000000','-221-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3848,'Sparta','King Agesilaus II of Sparta arrives with 1,000 men to assist Egypt in its fight with Persia.','37.07583303','22.42083165','-362','0','0','-362-0-0 00:00:00.000000','-362-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3849,'Sparta','The Egyptians under their King Teos and the Spartans under King Agesilaus II, with some Athenian mercenaries under their general Chabrias, set out to attack the Persian King''s Phoenician cities. However, they have to return almost at once due to revolts back in Egypt. Subsequently, Agesilaus II quarrels with the Egyptian king and joins a revolt against him.','37.07583303','22.42083165','-361','0','0','-361-0-0 00:00:00.000000','-361-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3850,'Sparta','The Athenian admiral Phormio has two naval victories, the Naupactus and the Battle of Chalcis at the mouth of the Corinthian Gulf. In the first battle, his 20 ships defeat 47 Corinthian ships commanded by Machaon, Isocrates, and Agatharchidas that were advancing to reinforce the Spartan general, Cnemus'' campaign in Acarnania. In the second battle, Phormio routs Cnemus'' 77-vessel fleet.','37.07583303','22.42083165','-429','0','0','-429-0-0 00:00:00.000000','-429-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3851,'Sparta','In Athens, Ephialtes and Pericles finally get agreement to the ostracism of Kimon, who had become unpopular for his unsuccessful pro-Spartan policy.','37.07583303','22.42083165','-461','0','0','-461-0-0 00:00:00.000000','-461-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3852,'Sparta','The chief city of Lesbos, Mytilene, revolts against Athenian rule. The Spartan admiral, Alcidas, leads 40 Peloponnesian alliance ships with the aim of assisting the inhabitants of Mytilene. However, the rebellion by Mytilene is crushed before his forces can arrive.','37.07583303','22.42083165','-428','0','0','-428-0-0 00:00:00.000000','-428-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3853,'Sparta','Archidamus IV, king of Sparta, son of Eudamidas I and grandson of Archidamus III, is defeated by Demetrius Poliorcetes of Macedonia in a battle at Mantinea. Sparta is saved only because Demetrius is called away by the threatening activities of his rivals Lysimachus and Ptolemy.','37.07583303','22.42083165','-294','0','0','-294-0-0 00:00:00.000000','-294-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3854,'Sparta','The Greek historian Herodotus, the main source for the Greco-Persian Wars, mentions Pheidippides as the messenger who runs from Athens to Sparta asking for help, and then runs back, a distance of over 240 kilometres each way. After the battle, he runs back to Athens to spread the news and raise the spirits. It is claimed that his last words before collapsing and dying in Athens are Chariete nikomen (Rejoice, we are victorious).','37.07583303','22.42083165','-490','0','0','-490-0-0 00:00:00.000000','-490-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3855,'Sparta','After allying with Hannibal, Philip V of Macedon attacks the Roman positions in Illyria, but fails to take Corcyra or Apollonia, which are protected by the Roman fleet. Rome''s command of the sea prevents his lending any effective aid to his Carthaginian ally in Italy. The Aetolians, Sparta and King Attalus of Pergamum join the Romans in the war against Philip V. This coalition is so strong that Philip V has to stop attacking Roman territory.','37.07583303','22.42083165','-210','0','0','-210-0-0 00:00:00.000000','-210-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3856,'Sparta','Brasidas'' capture of the city of Amphipolis is a major reverse for Athens, for which the Athenian general (and future historian) Thucydides is held responsible and banished. This gives Thucydides the opportunity for undistracted study for his ''''History'''' and for travel and wider contacts, especially on the Peloponnesian side (Sparta and its allies).','37.07583303','22.42083165','-424','0','0','-424-0-0 00:00:00.000000','-424-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3857,'Sparta','The general leading the Achaean League, Philopoemen, introduces heavier Macedonian armour and phalanx tactics. His army then crushes the Spartans under the Spartan regent and general, Machanidas, in the battle of Mantinea. Machanidas is killed by Philopoemen during the battle.','37.07583303','22.42083165','-207','0','0','-207-0-0 00:00:00.000000','-207-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3858,'Sparta','Athenian leader, Cleon, ends the truce between Athens and Sparta after he resolves to rescue the town of Amphipolis in Macedonia. However, through skillful generalship by Brasidas, the Spartans rout the Athenians in the Battle of Amphipolis. Both Brasidas and Cleon are killed in the battle, thereby removing the key members of the pro-war factions on both sides.','37.07583303','22.42083165','-422','0','0','-422-0-0 00:00:00.000000','-422-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3859,'Sparta','The Visigoths plundered Corinth, Argos and Sparta then withdrew to Epirus before the Roman army under Stilicho.','37.07583303','22.42083165','396','0','0','396-0-0 00:00:00.000000','396-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3860,'Sparta','The First Peloponnesian War breaks out between the Delian League (led by Athens) and a Peloponnesian alliance (led by Sparta), caused in part by Athens'' alliance with Megara and Argos and the subsequent reaction of Sparta. The Athenians have built long walls for the Megarans to their port at Nisaea, thereby earning the enmity of Megara''s old rival Corinth.','37.07583303','22.42083165','-460','0','0','-460-0-0 00:00:00.000000','-460-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3861,'Sparta','After the peace, the Spartan king, Nabis, goes to war with the Achaean League. The Achaean general Philopoemen expels Nabis of Sparta from Messene.','37.07583303','22.42083165','-205','0','0','-205-0-0 00:00:00.000000','-205-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3862,'Sparta','The Athenian general, Laches, successfully moves in the Athenian Assembly for an armistice with Sparta to check the progress of Sparta''s most effective general, Brasidas. However, the Truce of Laches has little impact on Brasidas and collapses within a year.','37.07583303','22.42083165','-423','0','0','-423-0-0 00:00:00.000000','-423-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3863,'Sparta','The Spartan king, Nabis, once more invades and captures Messene. However, the Spartans are forced to retreat when the Achaean League army of Philopoemen intervenes. Nabis'' forces are decisively defeated at Tegea by Philopoemen and Nabis is forced to check his expansionist ambitions for the time being.','37.07583303','22.42083165','-201','0','0','-201-0-0 00:00:00.000000','-201-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3864,'Sparta','Despite the Peace of Nicias still being in effect, Sparta''s King Agis II gathers a strong army at Philus and descends upon Argos by marching at night from the north. His allied Boeotian forces fail him, but he is able to conclude a treaty with Argos.','37.07583303','22.42083165','-419','0','0','-419-0-0 00:00:00.000000','-419-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3865,'Sparta','The Spartan ruler, Nabis, acquires the important city of Argos from Philip V of Macedon, as the price of his alliance with the Macedonians. Nabis then defects to the Romans in the expectation of being able to hold on to his conquest.','37.07583303','22.42083165','-197','0','0','-197-0-0 00:00:00.000000','-197-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3866,'Sparta','Before the Battle of Marathon, the Athenians send a runner, Pheidippides, to seek help from Sparta. However, the Spartans delay sending troops to Marathon because religious requirements (the Carnea) mean they must wait for the full moon.','37.07583303','22.42083165','-490','0','0','-490-0-0 00:00:00.000000','-490-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3867,'Sparta','Cleomenes I is forced to flee Sparta when his plot against Demaratus is discovered, but the Spartans allow him to return when he begins gathering an army in the surrounding territories. However, by this time he has become insane, and the Spartans put him in prison. Shortly after, he commits suicide. He is succeeded as King of Sparta by a member of the Agiad house, his half-brother, Leonidas.','37.07583303','22.42083165','-490','0','0','-490-0-0 00:00:00.000000','-490-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3868,'Sparta','Philip II advances into Peloponnesus. He defeats Thessaly, subdues Sparta and summons a Pan-Hellenic Congress at Corinth. This results in the establishment of Macedonian hegemony over central Greece (including Athens).','37.07583303','22.42083165','-338','0','0','-338-0-0 00:00:00.000000','-338-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3869,'Sparta','King Archidamus III is succeeded as the Eurypontid King of Sparta by his son, Agis III.','37.07583303','22.42083165','-338','0','0','-338-0-0 00:00:00.000000','-338-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3870,'Sparta','After checking the ambitions of the Spartan tyrant, Nabis, the Roman forces under pro-consul Titus Quinctius Flamininus finally withdraw from Greece.','37.07583303','22.42083165','-194','0','0','-194-0-0 00:00:00.000000','-194-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3871,'Sparta','In Sicily, the Ionian city of Segesta asks for Athenian help from the Dorian city of Selinus (which is supported by the powerful Sicilian city of Syracuse). The people of Syracuse are ethnically Dorian (as are the Spartans), while the Athenians, and their allies in Sicily, are Ionian. The Athenians feel obliged to assist their ally and therefore prepare an armada to attack Sicily.','37.07583303','22.42083165','-416','0','0','-416-0-0 00:00:00.000000','-416-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3872,'Sparta','Flamininus attempts to rally the Greeks against Antiochus III and to counter the pro-Seleucid policy of the Aetolians. When the Aetolians call on Antiochus III for aid, Flamininus persuades the Achaean League to declare war on both parties.  He also prevents Philopoemen from taking Sparta.','37.07583303','22.42083165','-193','0','0','-193-0-0 00:00:00.000000','-193-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3873,'Sparta','The Achaeans respond to Sparta''s renewed interest in recovering lost territory by sending an envoy to Rome with a request for help. In response, the Roman Senate sends the praetor Atilius with a navy, as well as an embassy headed by Titus Quinctius Flamininus.','37.07583303','22.42083165','-192','0','0','-192-0-0 00:00:00.000000','-192-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3874,'Sparta','After learning that he has been condemned to death ''''in absentia'''', Alcibiades defects to Sparta and Nicias is placed in charge of the Sicilian expedition. The Athenian forces land at Dascon near Syracuse but with little result. Hermocrates heads the Syracusan defence.','37.07583303','22.42083165','-415','0','0','-415-0-0 00:00:00.000000','-415-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3875,'Sparta','The democracy of Athens is overthrown by the oligarchic extremists, Antiphon, Theramenes, Peisander and Phrynichus in an effort by the oligarcists to exert more control over the conduct of the war with Sparta and its allies. A Council of Four Hundred is set up. The total defeat of the Athenian expedition to Sicily and the consequent revolts of many of the subject-allies has weakened Athenian finances severely; the acknowledged purpose of the revolutionary movement is to revise the constitution to better run Athens'' finances. However, its rule is high-handed and the Council of Four Hundred is only able to maintain itself for four months.','37.07583303','22.42083165','-411','0','0','-411-0-0 00:00:00.000000','-411-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3876,'Sparta','At a Pan-Hellenic Conference in Corinth, Philip II of Macedon announces the formation of the League of Corinth to liberate the Greek cities of Asia Minor from Persian rule, ostensibly because the Persian King, Arses, refuses to make reparations to Philip for Artaxerxes III''s aid to the city of Perinthus when it was resisting Philip. All the Greek cities (except Sparta) and the Greek islands swear their support to the league and to recognise Philip as president of the League. Philip establishes a council of representatives from all the Greek states, which is empowered to deliberate and decide on the actions to be taken. However, the real power lies with Philip who is declared commander of the League''s army.','37.07583303','22.42083165','-337','0','0','-337-0-0 00:00:00.000000','-337-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3877,'Sparta','The Athenian army moves to capture Syracuse while the larger fleet of Athenian ships blocks the approach to the city from the sea. After some initial success, the Athenian troops become disorganised in the chaotic night operation and are thoroughly routed by Gylippus, the Spartan commander. The Athenian commander Lamachus is killed. Nicias, although ill, is left in sole charge of the siege of Syracuse.','37.07583303','22.42083165','-414','0','0','-414-0-0 00:00:00.000000','-414-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3878,'Sparta','Alcibiades helps stir up revolts amongst Athens'' allies in Ionia, on the west coast of Asia Minor. However, Alcibiades loses the confidence of the Spartans and antagonises their king Agis II. As a result, he flees to the court of the Persian satrap Tissaphernes. Alcibiades advises Tissaphernes to withdraw his support from Sparta while conspiring with the oligarchic party in Athens, as Sparta''s allied cities break away in a series of revolts.','37.07583303','22.42083165','-412','0','0','-412-0-0 00:00:00.000000','-412-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3879,'Sparta','Despite Spartan opposition, Athens is refortified as well as rebuilt after the Persian destruction of the city.','37.07583303','22.42083165','-478','0','0','-478-0-0 00:00:00.000000','-478-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3880,'Sparta','Megara joins the revolt against Athens. The strategic importance of Megara is immediately demonstrated by the appearance, for the first time in 12 years, of a Spartan army under King Pleistoanax in Attica. The threat from the Spartan army leads Pericles to arrange, by bribery and by negotiation, that Athens will give up its mainland possessions and confine itself to a largely maritime empire.','37.07583303','22.42083165','-446','0','0','-446-0-0 00:00:00.000000','-446-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
INSERT INTO "histories-all" VALUES(3881,'Sparta','Alexander''s regent in Macedonia, Antipater, makes peace with the Thracians (with whom he has been warring) and then marches south with a large force of over 40,000 men. He wins a hard-fought Battle of Megalopolis in Arcadia against Agis III of Sparta and his Greek mercenaries. Agis III is killed, and Spartan resistance is broken.','37.07583303','22.42083165','-330','0','0','-330-0-0 00:00:00.000000','-330-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
