INSERT INTO "histories-all" VALUES(3883,'Sphacteria','Demosthenes captures and fortifies the port of Pylos in the Peloponnesus, giving Athens a strong base close to Sparta. Meanwhile, a Spartan army, commanded by Brasidas, lands on the nearby island of Sphacteria, but is repulsed by the Athenians. An Athenian fleet summoned by Demosthenes bottles up the Spartan navy in Navarino Bay.','36.9247446343','21.6594323623','-425','0','0','-425-0-0 00:00:00.000000','-425-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
