INSERT INTO "histories-all" VALUES(4127,'Tylis','An army of Gauls under Brennus invade Greece. A section of the army, commanded by Bolgios, crushes a Macedonian army led by Ptolemy Keraunos, who is killed in the battle. At the narrow pass of Thermopylae, on the east coast of central Greece, Brennus'' forces suffer heavy losses while trying to break through the Greek defence comprising the Phocians and the Aetolians. Eventually Brennus finds a way around the pass but the Greeks escape by sea. Brennus pushes on to Delphi where he is defeated and forced to retreat, after which he dies of wounds sustained in the battle. His army falls back to the river Spercheios where it is routed by Thessalians and Malians. Some of the survivors settle in a part of Asia Minor that will eventually be called Galatia, while some settle in Thrace, founding a short-lived city-state named Tylis.','42.583331','25.5499978','-279','0','0','-279-0-0 00:00:00.000000','-279-0-0 00:00:00.000000','0','0','0','0','0','2014-02-23 15:43:55.236165','2014-02-23 18:01:05.965668');
