INSERT INTO "hists" VALUES('Ulrich of Strasbourg',1220,1277,'Ulrich of Strasburg (c. 1225–1277) was a German Dominican theologian and scholastic philosopher. A disciple of Albertus Magnus, he is known for his Summa de Bono, written 1265 to 1272.',NULL,'Strasbourg, Germany','48.4166227,9.5357837','51.164175, 10.454145','Wikipedia',NULL);
