PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "timeline_keeper_admin_users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar(255) DEFAULT '' NOT NULL, "encrypted_password" varchar(255) DEFAULT '' NOT NULL, "reset_password_token" varchar(255), "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar(255), "last_sign_in_ip" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "timeline_keeper_events" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "headline" varchar(255), "text" text, "latitude" varchar(255), "longitude" varchar(255), "event_year" varchar(255), "event_month" varchar(255), "event_day" varchar(255), "startDate" datetime, "endDate" datetime, "media" varchar(255), "credit" varchar(255), "caption" varchar(255), "thumbnail" varchar(255), "media_filename" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "timeline_keeper_timelines" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "headline" varchar(255), "startDate" datetime, "text" text, "media" varchar(255), "credit" varchar(255), "caption" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "timeline_keeper_timeline_events" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "timeline_id" integer, "event_id" integer, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar(255) DEFAULT '' NOT NULL, "encrypted_password" varchar(255) DEFAULT '' NOT NULL, "reset_password_token" varchar(255), "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar(255), "last_sign_in_ip" varchar(255), "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE "histories-original" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "startdate" datetime, "enddate" datetime, "content" varchar(255), "headline" varchar(255), "media" varchar(255), "mediacaption" varchar(255), "mediacredit" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "histories-all" ("id" INTEGER PRIMARY KEY  NOT NULL ,"headline" varchar(255),"content" text DEFAULT (null) ,"latitude" varchar(255),"longitude" varchar(255),"event_year" varchar(255),"event_month" varchar(255),"event_day" varchar(255),"startdate" datetime DEFAULT (null) ,"enddate" datetime DEFAULT (null) ,"media" varchar(255),"mediacredit" varchar(255) DEFAULT (null) ,"mediacaption" varchar(255) DEFAULT (null) ,"thumbnail" varchar(255),"media_filename" varchar(255),"created_at" datetime NOT NULL ,"updated_at" datetime NOT NULL );
CREATE TABLE "hists-old" ("id" INTEGER PRIMARY KEY  NOT NULL ,"headline" varchar(255),"content" text DEFAULT (null) ,"latitude" varchar(255),"longitude" varchar(255),"event_year" varchar(255),"event_month" varchar(255),"event_day" varchar(255),"startdate" datetime DEFAULT (null) ,"enddate" datetime DEFAULT (null) ,"media" varchar(255),"mediacredit" varchar(255) DEFAULT (null) ,"mediacaption" varchar(255) DEFAULT (null) ,"thumbnail" varchar(255),"media_filename" varchar(255),"created_at" datetime NOT NULL ,"updated_at" datetime NOT NULL );
CREATE TABLE "admin_users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar(255) DEFAULT '' NOT NULL, "encrypted_password" varchar(255) DEFAULT '' NOT NULL, "reset_password_token" varchar(255), "reset_password_sent_at" datetime, "remember_created_at" datetime, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" datetime, "last_sign_in_at" datetime, "current_sign_in_ip" varchar(255), "last_sign_in_ip" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "active_admin_comments" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "namespace" varchar(255), "body" text, "resource_id" varchar(255) NOT NULL, "resource_type" varchar(255) NOT NULL, "author_id" integer, "author_type" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "philosophers" ("Title" VARCHAR, "Start" NUMERIC, "End" NUMERIC, "Description" TEXT, "Image" VARCHAR, "Place" VARCHAR, "Location" VARCHAR, "Location_Original" VARCHAR, "Source" VARCHAR, "Source URL" VARCHAR);
Little is known of his life, but he is thought to have studied in Paris, as a master at Oxford in 1252, treasurer of Lincoln from 1254/8 onwards, and a rector of Aylesbury.
He was the author of two books which were an important influence on the development of Scholastic logic: Introductiones in Logicam (Introduction to Logic), and Syncategoremata. These are the first known works to deal in a systematic way with what is now called supposition theory, known in William''s time as the logica moderna.',NULL,'Sherwood, England','52.9812277,-1.1503521','52.84145, -2.30546','Wikipedia',NULL);
He studied under John Pecham in Paris, in the years around 1270, and probably also at Oxford a few years later, during the time he was a pupil of John Pecham he was a fellow student with Matthew of Aquasparta. He generally followed Pecham''s views on the Eucharist,. He regarded time as absolute',NULL,'England','52.7955,-0.540522271821464','52.84145, -2.30546','Wikipedia',NULL);
He was ordained as deacon in 1274 by Walter Giffard, and joined the Dominicans in the 1270s; he may have been a Fellow of Merton College, Oxford before that. He became doctor of theology in 1282.[4].',NULL,'Sutton, England','51.360398,-0.1906996','52.84145, -2.30546','Wikipedia',NULL);
He was a canon of Paris; some biographers have thought that he was Bishop of Clermont, because a Bull of Boniface VIII of the year 1296 names as canon of Paris a certain Peter of Croc (Cros), already canon of Clermont; but it is more likely that they are distinct. Peter of Auvergne was in Paris in 1301, and, according to several accounts, was a pupil of Thomas Aquinas. In 1279, while the various nations of the University of Paris were quarrelling about the rectorship, Simon de Brion, papal legate, appointed Peter of Auvergne, to that office; in 1296 he was elected to it.',NULL,'Auvergne, France','45.3548759,3.195472','46.211401, 2.20936','Wikipedia',NULL);
Simon of Faversham was born in Faversham, Kent, and educated at Oxford, receiving a Master of Arts degree. He probably taught in Paris during the 1280s. His philosophical work consists almost entirely of commentaries on Aristotle''s works.[citation needed] He was made Chancellor of Oxford University in January 1304 until his death in 1306.',NULL,'Faversham, England','51.3144088,0.8911894','52.84145, -2.30546','Wikipedia',NULL);
